insert into project (title, description, thumbnail_url, owner_id, category_id, created_at, end_at, goal_fund_raising, current_fund_raising, deleted) VALUES ('[셰프찬] 밑반찬세트','<img src="https://cdn.bmf.kr/_data/files/product/12012/ff1782601c23dbb9073ed1d0ba1babd8.jpg" /><img src="https://cdn.bmf.kr/_data/product/201608/31/28528f16e4b468bc3e966ddbfff7d1ff.jpg" /><img src="https://cdn.bmf.kr/_data/files/product/12012/9156f16d2fb4d82fb07a742bfb689ed8.jpg" /><img src="https://cdn.bmf.kr/_data/files/product/12012/c3ad145bba64cd6dd0733588e66d7f46.jpg" /><img src="https://cdn.bmf.kr/_data/files/product/12012/36b08714376a6f513ee2c6cd801c637a.jpg" /><img src="https://cdn.bmf.kr/_data/files/product/12012/d4e6469f096df7db070d18157a8a9214.jpg" /><img src="https://cdn.bmf.kr/_data/files/product/12012/f943945da869f41248a5fe18c8a1bf08.jpg" /><img src="https://cdn.bmf.kr/_data/files/product/12012/b304d567aaf13c3116edb2a033b8d9f4.jpg" />
insert into product (project_id, title, description, price, quantity_supplied, quantity_remained, deleted) values (1, '짭조름한 일본', '한 회계연도를 넘어 계속하여 지출할 필요가 있을 때에는 정부는 연한을 정하여 계속비로서 국회의 의결을 얻어야 한다. 군인은 현역을 면한 후가 아니면 국무총리로 임명될 수 없다.', 25000, 400, 183, false);
insert into product (project_id, title, description, price, quantity_supplied, quantity_remained, deleted) values (1, '씁쓰름한 수단', '국군의 조직과 편성은 법률로 정한다. 의무교육은 무상으로 한다. 여자의 근로는 특별한 보호를 받으며, 고용·임금 및 근로조건에 있어서 부당한 차별을 받지 아니한다.', 5000, 140, 81, false);
insert into product (project_id, title, description, price, quantity_supplied, quantity_remained, deleted) values (1, '짭짤한 사하라 아랍 민주 공화국', '신체장애자 및 질병·노령 기타의 사유로 생활능력이 없는 국민은 법률이 정하는 바에 의하여 국가의 보호를 받는다. 국무총리는 대통령을 보좌하며, 행정에 관하여 대통령의 명을 받아 행', 31000, 240, 87, false);
insert into product (project_id, title, description, price, quantity_supplied, quantity_remained, deleted) values (1, '시큼한 나이지리아', '대통령은 국가의 원수이며, 외국에 대하여 국가를 대표한다. 재판의 전심절차로서 행정심판을 할 수 있다. 행정심판의 절차는 법률로 정하되, 사법절차가 준용되어야 한다.', 50000, 100, 20, false);
insert into product (project_id, title, description, price, quantity_supplied, quantity_remained, deleted) values (2, '개운한 페루', '언론·출판에 대한 허가나 검열과 집회·결사에 대한 허가는 인정되지 아니한다. 국가는 사회보장·사회복지의 증진에 노력할 의무를 진다. 국회의원의 수는 법률로 정하되, 200인 이상으', 8000, 330, 149, false);
insert into product (project_id, title, description, price, quantity_supplied, quantity_remained, deleted) values (2, '짭조름한 네덜란드', '민주평화통일자문회의의 조직·직무범위 기타 필요한 사항은 법률로 정한다. 외국인은 국제법과 조약이 정하는 바에 의하여 그 지위가 보장된다. 환경권의 내용과 행사에 관하여는 법률로 정', 39000, 120, 120, false);
insert into product (project_id, title, description, price, quantity_supplied, quantity_remained, deleted) values (2, '새콤달콤한 트리니다드 토바고', '국교는 인정되지 아니하며, 종교와 정치는 분리된다. 국회는 헌법개정안이 공고된 날로부터 60일 이내에 의결하여야 하며, 국회의 의결은 재적의원 3분의 2 이상의 찬성을 얻어야 한다', 45000, 310, 150, false);
insert into product (project_id, title, description, price, quantity_supplied, quantity_remained, deleted) values (2, '오동통한 트란스니스트리아', '비상계엄이 선포된 때에는 법률이 정하는 바에 의하여 영장제도, 언론·출판·집회·결사의 자유, 정부나 법원의 권한에 관하여 특별한 조치를 할 수 있다.', 36000, 100, 49, false);
insert into product (project_id, title, description, price, quantity_supplied, quantity_remained, deleted) values (3, '씁쓰름한 엘살바도르', '광물 기타 중요한 지하자원·수산자원·수력과 경제상 이용할 수 있는 자연력은 법률이 정하는 바에 의하여 일정한 기간 그 채취·개발 또는 이용을 특허할 수 있다.', 22000, 180, 96, false);
insert into product (project_id, title, description, price, quantity_supplied, quantity_remained, deleted) values (3, '바삭바삭한 에티오피아', '타인의 범죄행위로 인하여 생명·신체에 대한 피해를 받은 국민은 법률이 정하는 바에 의하여 국가로부터 구조를 받을 수 있다. 국가는 농지에 관하여 경자유전의 원칙이 달성될 수 있도록', 48000, 100, 38, false);
insert into product (project_id, title, description, price, quantity_supplied, quantity_remained, deleted) values (3, '매콤한 말레이시아', '군인·군무원·경찰공무원 기타 법률이 정하는 자가 전투·훈련등 직무집행과 관련하여 받은 손해에 대하여는 법률이 정하는 보상외에 국가 또는 공공단체에 공무원의 직무상 불법행위로 인한 ', 11000, 290, 127, false);
insert into product (project_id, title, description, price, quantity_supplied, quantity_remained, deleted) values (3, '바삭바삭한 에티오피아', '모든 국민은 소급입법에 의하여 참정권의 제한을 받거나 재산권을 박탈당하지 아니한다. 이 헌법에 의한 최초의 대통령의 임기는 이 헌법시행일로부터 개시한다.', 50000, 290, 133, false);
insert into product (project_id, title, description, price, quantity_supplied, quantity_remained, deleted) values (4, '짭조름한 니우에', '제1항의 지시를 받은 당해 행정기관은 이에 응하여야 한다. 대통령의 선거에 관한 사항은 법률로 정한다. 정부는 예산에 변경을 가할 필요가 있을 때에는 추가경정예산안을 편성하여 국회', 31000, 120, 54, false);
insert into product (project_id, title, description, price, quantity_supplied, quantity_remained, deleted) values (4, '담백한 에리트레아', '재산권의 행사는 공공복리에 적합하도록 하여야 한다. 지방의회의 조직·권한·의원선거와 지방자치단체의 장의 선임방법 기타 지방자치단체의 조직과 운영에 관한 사항은 법률로 정한다.', 9000, 300, 137, false);
insert into product (project_id, title, description, price, quantity_supplied, quantity_remained, deleted) values (4, '새콤달콤한 케냐', '공공필요에 의한 재산권의 수용·사용 또는 제한 및 그에 대한 보상은 법률로써 하되, 정당한 보상을 지급하여야 한다. 대한민국의 경제질서는 개인과 기업의 경제상의 자유와 창의를 존중', 8000, 120, 47, false);
insert into product (project_id, title, description, price, quantity_supplied, quantity_remained, deleted) values (4, '되직한 아르헨티나', '정부는 회계연도마다 예산안을 편성하여 회계연도 개시 90일전까지 국회에 제출하고, 국회는 회계연도 개시 30일전까지 이를 의결하여야 한다. 감사원의 조직·직무범위·감사위원의 자격·', 20000, 500, 269, false);
insert into product (project_id, title, description, price, quantity_supplied, quantity_remained, deleted) values (5, '고들고들한 몰도바', '대통령의 임기연장 또는 중임변경을 위한 헌법개정은 그 헌법개정 제안 당시의 대통령에 대하여는 효력이 없다. 모든 국민은 인간다운 생활을 할 권리를 가진다.', 5000, 240, 240, false);
insert into product (project_id, title, description, price, quantity_supplied, quantity_remained, deleted) values (5, '새콤달콤한 온두라스', '국회의 회의는 공개한다. 다만, 출석의원 과반수의 찬성이 있거나 의장이 국가의 안전보장을 위하여 필요하다고 인정할 때에는 공개하지 아니할 수 있다.', 46000, 240, 97, false);
insert into product (project_id, title, description, price, quantity_supplied, quantity_remained, deleted) values (5, '담백한 브루나이', '이 헌법시행 당시의 대법원장과 대법원판사가 아닌 법관은 제1항 단서의 규정에 불구하고 이 헌법에 의하여 임명된 것으로 본다. 국회의원은 법률이 정하는 직을 겸할 수 없다.', 15000, 330, 166, false);
insert into product (project_id, title, description, price, quantity_supplied, quantity_remained, deleted) values (5, '짭조름한 니카라과', '헌법재판소 재판관은 탄핵 또는 금고 이상의 형의 선고에 의하지 아니하고는 파면되지 아니한다. 신체장애자 및 질병·노령 기타의 사유로 생활능력이 없는 국민은 법률이 정하는 바에 의하', 8000, 280, 93, false);
insert into product (project_id, title, description, price, quantity_supplied, quantity_remained, deleted) values (6, '개운한 페루', '민주평화통일자문회의의 조직·직무범위 기타 필요한 사항은 법률로 정한다. 국무총리는 대통령을 보좌하며, 행정에 관하여 대통령의 명을 받아 행정각부를 통할한다.', 40000, 240, 107, false);
insert into product (project_id, title, description, price, quantity_supplied, quantity_remained, deleted) values (6, '개운한 앙골라', '국회는 의원의 자격을 심사하며, 의원을 징계할 수 있다. 누구든지 병역의무의 이행으로 인하여 불이익한 처우를 받지 아니한다. 농업생산성의 제고와 농지의 합리적인 이용을 위하거나 불', 12000, 250, 158, false);
insert into product (project_id, title, description, price, quantity_supplied, quantity_remained, deleted) values (6, '매콤한 코소보', '국가는 전통문화의 계승·발전과 민족문화의 창달에 노력하여야 한다. 공공필요에 의한 재산권의 수용·사용 또는 제한 및 그에 대한 보상은 법률로써 하되, 정당한 보상을 지급하여야 한다', 30000, 340, 181, false);
insert into product (project_id, title, description, price, quantity_supplied, quantity_remained, deleted) values (6, '오동통한 파라과이', '중앙선거관리위원회는 법령의 범위안에서 선거관리·국민투표관리 또는 정당사무에 관한 규칙을 제정할 수 있으며, 법률에 저촉되지 아니하는 범위안에서 내부규율에 관한 규칙을 제정할 수 있', 24000, 260, 124, false);
insert into product (project_id, title, description, price, quantity_supplied, quantity_remained, deleted) values (7, '새콤달콤한 소말릴란드', '대한민국의 국민이 되는 요건은 법률로 정한다. 이 헌법시행 당시의 대법원장과 대법원판사가 아닌 법관은 제1항 단서의 규정에 불구하고 이 헌법에 의하여 임명된 것으로 본다.', 21000, 330, 166, false);
insert into product (project_id, title, description, price, quantity_supplied, quantity_remained, deleted) values (7, '담백한 베트남', '대통령은 법률이 정하는 바에 의하여 사면·감형 또는 복권을 명할 수 있다. 대통령은 국가의 안위에 관계되는 중대한 교전상태에 있어서 국가를 보위하기 위하여 긴급한 조치가 필요하고 ', 47000, 410, 211, false);
insert into product (project_id, title, description, price, quantity_supplied, quantity_remained, deleted) values (7, '달짝지근한 폴란드', '국회의원은 국가이익을 우선하여 양심에 따라 직무를 행한다. 법관은 헌법과 법률에 의하여 그 양심에 따라 독립하여 심판한다. 대법원과 각급법원의 조직은 법률로 정한다.', 50000, 310, 147, false);
insert into product (project_id, title, description, price, quantity_supplied, quantity_remained, deleted) values (7, '바삭바삭한 대한민국', '이 헌법시행 당시의 대법원장과 대법원판사가 아닌 법관은 제1항 단서의 규정에 불구하고 이 헌법에 의하여 임명된 것으로 본다. 국회의원은 국가이익을 우선하여 양심에 따라 직무를 행한', 30000, 150, 63, false);
insert into product (project_id, title, description, price, quantity_supplied, quantity_remained, deleted) values (8, '담백한 스리랑카', '모든 국민은 사생활의 비밀과 자유를 침해받지 아니한다. 제안된 헌법개정안은 대통령이 20일 이상의 기간 이를 공고하여야 한다. 국민경제자문회의의 조직·직무범위 기타 필요한 사항은 ', 36000, 180, 82, false);
insert into product (project_id, title, description, price, quantity_supplied, quantity_remained, deleted) values (8, '개운한 타지키스탄', '감사원은 세입·세출의 결산을 매년 검사하여 대통령과 차년도국회에 그 결과를 보고하여야 한다. 국민의 자유와 권리는 헌법에 열거되지 아니한 이유로 경시되지 아니한다.', 33000, 140, 43, false);
insert into product (project_id, title, description, price, quantity_supplied, quantity_remained, deleted) values (8, '달짝지근한 안도라', '의원을 제명하려면 국회재적의원 3분의 2 이상의 찬성이 있어야 한다. 헌법개정은 국회재적의원 과반수 또는 대통령의 발의로 제안된다. 명령·규칙 또는 처분이 헌법이나 법률에 위반되는', 31000, 190, 110, false);
insert into product (project_id, title, description, price, quantity_supplied, quantity_remained, deleted) values (8, '시큼한 이집트', '근로조건의 기준은 인간의 존엄성을 보장하도록 법률로 정한다. 새로운 회계연도가 개시될 때까지 예산안이 의결되지 못한 때에는 정부는 국회에서 예산안이 의결될 때까지 다음의 목적을 위', 27000, 120, 41, false);
insert into product (project_id, title, description, price, quantity_supplied, quantity_remained, deleted) values (9, '새콤달콤한 소말릴란드', '형사피의자 또는 형사피고인으로서 구금되었던 자가 법률이 정하는 불기소처분을 받거나 무죄판결을 받은 때에는 법률이 정하는 바에 의하여 국가에 정당한 보상을 청구할 수 있다.', 5000, 280, 148, false);
insert into product (project_id, title, description, price, quantity_supplied, quantity_remained, deleted) values (9, '매콤한 바티칸 시국', '국가는 과학기술의 혁신과 정보 및 인력의 개발을 통하여 국민경제의 발전에 노력하여야 한다. 헌법재판소의 장은 국회의 동의를 얻어 재판관중에서 대통령이 임명한다.', 49000, 450, 232, false);
insert into product (project_id, title, description, price, quantity_supplied, quantity_remained, deleted) values (9, '매콤한 바베이도스', '이 헌법시행 당시의 대법원장과 대법원판사가 아닌 법관은 제1항 단서의 규정에 불구하고 이 헌법에 의하여 임명된 것으로 본다. 헌법개정은 국회재적의원 과반수 또는 대통령의 발의로 제', 7000, 390, 167, false);
insert into product (project_id, title, description, price, quantity_supplied, quantity_remained, deleted) values (9, '달콤한 짐바브웨', '대법원과 각급법원의 조직은 법률로 정한다. 대통령이 궐위되거나 사고로 인하여 직무를 수행할 수 없을 때에는 국무총리, 법률이 정한 국무위원의 순서로 그 권한을 대행한다.', 34000, 140, 50, false);
insert into product (project_id, title, description, price, quantity_supplied, quantity_remained, deleted) values (10, '짭짤한 이스라엘', '국토와 자원은 국가의 보호를 받으며, 국가는 그 균형있는 개발과 이용을 위하여 필요한 계획을 수립한다. 사회적 특수계급의 제도는 인정되지 아니하며, 어떠한 형태로도 이를 창설할 수', 35000, 140, 56, false);
insert into product (project_id, title, description, price, quantity_supplied, quantity_remained, deleted) values (10, '담백한 키프로스', '법원은 최고법원인 대법원과 각급법원으로 조직된다. 모든 국민은 법률이 정하는 바에 의하여 선거권을 가진다. 근로조건의 기준은 인간의 존엄성을 보장하도록 법률로 정한다.', 46000, 440, 243, false);
insert into product (project_id, title, description, price, quantity_supplied, quantity_remained, deleted) values (10, '바삭바삭한 에티오피아', '훈장등의 영전은 이를 받은 자에게만 효력이 있고, 어떠한 특권도 이에 따르지 아니한다. 국가는 법률이 정하는 바에 의하여 재외국민을 보호할 의무를 진다.', 44000, 500, 224, false);
insert into product (project_id, title, description, price, quantity_supplied, quantity_remained, deleted) values (10, '담백한 스웨덴', '공무원은 국민전체에 대한 봉사자이며, 국민에 대하여 책임을 진다. 국정의 중요한 사항에 관한 대통령의 자문에 응하기 위하여 국가원로로 구성되는 국가원로자문회의를 둘 수 있다.', 27000, 110, 44, false);
insert into product (project_id, title, description, price, quantity_supplied, quantity_remained, deleted) values (11, '고들고들한 가이아나', '법률이 헌법에 위반되는 여부가 재판의 전제가 된 경우에는 법원은 헌법재판소에 제청하여 그 심판에 의하여 재판한다. 국가는 균형있는 국민경제의 성장 및 안정과 적정한 소득의 분배를 ', 9000, 430, 251, false);
insert into product (project_id, title, description, price, quantity_supplied, quantity_remained, deleted) values (11, '짭조름한 몬테네그로', '국회에 제출된 법률안 기타의 의안은 회기중에 의결되지 못한 이유로 폐기되지 아니한다. 다만, 국회의원의 임기가 만료된 때에는 그러하지 아니하다. 국가는 재해를 예방하고 그 위험으로', 30000, 370, 160, false);
