insert into product (project_id, title, description, price, quantity_supplied, quantity_remained, deleted) values (11, '짭짤한 이스라엘', '타인의 범죄행위로 인하여 생명·신체에 대한 피해를 받은 국민은 법률이 정하는 바에 의하여 국가로부터 구조를 받을 수 있다. 이 헌법중 공무원의 임기 또는 중임제한에 관한 규정은 이', 46000, 130, 130, false);
insert into product (project_id, title, description, price, quantity_supplied, quantity_remained, deleted) values (12, '달짝지근한 남오세티야', '재판의 전심절차로서 행정심판을 할 수 있다. 행정심판의 절차는 법률로 정하되, 사법절차가 준용되어야 한다. 이 헌법중 공무원의 임기 또는 중임제한에 관한 규정은 이 헌법에 의하여 ', 20000, 380, 227, false);
insert into product (project_id, title, description, price, quantity_supplied, quantity_remained, deleted) values (12, '달콤한 모로코', '대한민국은 통일을 지향하며, 자유민주적 기본질서에 입각한 평화적 통일 정책을 수립하고 이를 추진한다. 국무총리는 국무위원의 해임을 대통령에게 건의할 수 있다.', 21000, 100, 46, false);
insert into product (project_id, title, description, price, quantity_supplied, quantity_remained, deleted) values (12, '매콤한 모나코', '국가는 건전한 소비행위를 계도하고 생산품의 품질향상을 촉구하기 위한 소비자보호운동을 법률이 정하는 바에 의하여 보장한다. 국교는 인정되지 아니하며, 종교와 정치는 분리된다.', 32000, 260, 111, false);
insert into product (project_id, title, description, price, quantity_supplied, quantity_remained, deleted) values (12, '짭짤한 몽골', '대통령의 임기는 5년으로 하며, 중임할 수 없다. 모든 국민은 고문을 받지 아니하며, 형사상 자기에게 불리한 진술을 강요당하지 아니한다. 대통령은 국무총리·국무위원·행정각부의 장 ', 13000, 500, 222, false);
