insert into product (project_id, title, description, price, quantity_supplied, quantity_remained, deleted) values (13, '새콤한 카메룬', '국회의 정기회는 법률이 정하는 바에 의하여 매년 1회 집회되며, 국회의 임시회는 대통령 또는 국회재적의원 4분의 1 이상의 요구에 의하여 집회된다. 대법원과 각급법원의 조직은 법률', 17000, 300, 135, false);
