insert into product (project_id, title, description, price, quantity_supplied, quantity_remained, deleted) values (13, '매콤한 라오스', '대통령은 법률에서 구체적으로 범위를 정하여 위임받은 사항과 법률을 집행하기 위하여 필요한 사항에 관하여 대통령령을 발할 수 있다. 혼인과 가족생활은 개인의 존엄과 양성의 평등을 기', 27000, 500, 343, false);
