insert into product (project_id, title, description, price, quantity_supplied, quantity_remained, deleted) values (14, '새콤달콤한 벨기에', '헌법에 의하여 체결·공포된 조약과 일반적으로 승인된 국제법규는 국내법과 같은 효력을 가진다. 국가는 사회보장·사회복지의 증진에 노력할 의무를 진다.', 39000, 470, 195, false);
