insert into product (project_id, title, description, price, quantity_supplied, quantity_remained, deleted) values (15, '오동통한 러시아', '계엄을 선포한 때에는 대통령은 지체없이 국회에 통고하여야 한다. 국가안전보장회의의 조직·직무범위 기타 필요한 사항은 법률로 정한다. 제1항의 지시를 받은 당해 행정기관은 이에 응하', 5000, 410, 216, false);
