insert into product (project_id, title, description, price, quantity_supplied, quantity_remained, deleted) values (15, '짭짤한 그레나다', '대통령이 제1항의 기간내에 공포나 재의의 요구를 하지 아니한 때에도 그 법률안은 법률로서 확정된다. 국가안전보장에 관련되는 대외정책·군사정책과 국내정책의 수립에 관하여 국무회의의 ', 31000, 320, 165, false);
