insert into product (project_id, title, description, price, quantity_supplied, quantity_remained, deleted) values (16, '달달한 세네갈', '이 헌법은 1988년 2월 25일부터 시행한다. 다만, 이 헌법을 시행하기 위하여 필요한 법률의 제정·개정과 이 헌법에 의한 대통령 및 국회의원의 선거 기타 이 헌법시행에 관한 준', 13000, 250, 115, false);
insert into product (project_id, title, description, price, quantity_supplied, quantity_remained, deleted) values (16, '씁쓰름한 수단', '형사피고인은 유죄의 판결이 확정될 때까지는 무죄로 추정된다. 모든 국민은 법률이 정하는 바에 의하여 납세의 의무를 진다. 국가는 국민 모두의 생산 및 생활의 기반이 되는 국토의 효', 33000, 470, 210, false);
insert into product (project_id, title, description, price, quantity_supplied, quantity_remained, deleted) values (16, '오동통한 르완다', '공무원인 근로자는 법률이 정하는 자에 한하여 단결권·단체교섭권 및 단체행동권을 가진다. 모든 국민은 직업선택의 자유를 가진다. 법원은 최고법원인 대법원과 각급법원으로 조직된다.', 21000, 500, 232, false);
