insert into product (project_id, title, description, price, quantity_supplied, quantity_remained, deleted) values (17, '달콤한 짐바브웨', '국가는 지역간의 균형있는 발전을 위하여 지역경제를 육성할 의무를 진다. 이 헌법시행 당시에 이 헌법에 의하여 새로 설치될 기관의 권한에 속하는 직무를 행하고 있는 기관은 이 헌법에', 48000, 310, 133, false);
insert into product (project_id, title, description, price, quantity_supplied, quantity_remained, deleted) values (17, '오동통한 마셜 제도', '제안된 헌법개정안은 대통령이 20일 이상의 기간 이를 공고하여야 한다. 국회의 회의는 공개한다. 다만, 출석의원 과반수의 찬성이 있거나 의장이 국가의 안전보장을 위하여 필요하다고 ', 25000, 400, 193, false);
insert into product (project_id, title, description, price, quantity_supplied, quantity_remained, deleted) values (17, '매콤한 통가', '모든 국민은 주거의 자유를 침해받지 아니한다. 주거에 대한 압수나 수색을 할 때에는 검사의 신청에 의하여 법관이 발부한 영장을 제시하여야 한다. 대통령은 조약을 체결·비준하고, 외', 30000, 260, 125, false);
