insert into product (project_id, title, description, price, quantity_supplied, quantity_remained, deleted) values (18, '새콤달콤한 온두라스', '국회의원은 국회에서 직무상 행한 발언과 표결에 관하여 국회외에서 책임을 지지 아니한다. 국무총리는 대통령을 보좌하며, 행정에 관하여 대통령의 명을 받아 행정각부를 통할한다.', 38000, 390, 169, false);
insert into product (project_id, title, description, price, quantity_supplied, quantity_remained, deleted) values (18, '담백한 콩고 공화국', '모든 국민은 근로의 의무를 진다. 국가는 근로의 의무의 내용과 조건을 민주주의원칙에 따라 법률로 정한다. 탄핵소추의 의결을 받은 자는 탄핵심판이 있을 때까지 그 권한행사가 정지된다', 10000, 470, 201, false);
insert into product (project_id, title, description, price, quantity_supplied, quantity_remained, deleted) values (19, '새콤달콤한 불가리아', '대통령은 국가의 안위에 관계되는 중대한 교전상태에 있어서 국가를 보위하기 위하여 긴급한 조치가 필요하고 국회의 집회가 불가능한 때에 한하여 법률의 효력을 가지는 명령을 발할 수 있', 42000, 240, 137, false);
