insert into product (project_id, title, description, price, quantity_supplied, quantity_remained, deleted) values (19, '짭짤한 사하라 아랍 민주 공화국', '국방상 또는 국민경제상 긴절한 필요로 인하여 법률이 정하는 경우를 제외하고는, 사영기업을 국유 또는 공유로 이전하거나 그 경영을 통제 또는 관리할 수 없다.', 8000, 260, 164, false);
insert into product (project_id, title, description, price, quantity_supplied, quantity_remained, deleted) values (19, '짭짤한 지부티', '국가는 균형있는 국민경제의 성장 및 안정과 적정한 소득의 분배를 유지하고, 시장의 지배와 경제력의 남용을 방지하며, 경제주체간의 조화를 통한 경제의 민주화를 위하여 경제에 관한 규', 10000, 100, 48, false);
insert into product (project_id, title, description, price, quantity_supplied, quantity_remained, deleted) values (20, '매콤한 코소보', '감사위원은 원장의 제청으로 대통령이 임명하고, 그 임기는 4년으로 하며, 1차에 한하여 중임할 수 있다. 모든 국민은 언론·출판의 자유와 집회·결사의 자유를 가진다.', 40000, 380, 149, false);
