insert into product (project_id, title, description, price, quantity_supplied, quantity_remained, deleted) values (21, '짭조름한 몬테네그로', '대통령의 임기가 만료되는 때에는 임기만료 70일 내지 40일전에 후임자를 선거한다. 대법원과 각급법원의 조직은 법률로 정한다. 대한민국의 영토는 한반도와 그 부속도서로 한다.', 43000, 180, 84, false);
