insert into product (project_id, title, description, price, quantity_supplied, quantity_remained, deleted) values (22, '시큼한 아프가니스탄', '대통령의 임기연장 또는 중임변경을 위한 헌법개정은 그 헌법개정 제안 당시의 대통령에 대하여는 효력이 없다. 공개하지 아니한 회의내용의 공표에 관하여는 법률이 정하는 바에 의한다.', 44000, 490, 175, false);
