insert into product (project_id, title, description, price, quantity_supplied, quantity_remained, deleted) values (25, '담백한 이라크', '법관은 탄핵 또는 금고 이상의 형의 선고에 의하지 아니하고는 파면되지 아니하며, 징계처분에 의하지 아니하고는 정직·감봉 기타 불리한 처분을 받지 아니한다.', 43000, 310, 132, false);
