insert into product (project_id, title, description, price, quantity_supplied, quantity_remained, deleted) values (26, '달짝지근한 체코', '국가는 법률이 정하는 바에 의하여 재외국민을 보호할 의무를 진다. 국가는 대외무역을 육성하며, 이를 규제·조정할 수 있다. 모든 국민의 재산권은 보장된다. 그 내용과 한계는 법률로', 34000, 150, 70, false);
insert into product (project_id, title, description, price, quantity_supplied, quantity_remained, deleted) values (26, '씁쓰름한 사모아', '군인은 현역을 면한 후가 아니면 국무총리로 임명될 수 없다. 국군은 국가의 안전보장과 국토방위의 신성한 의무를 수행함을 사명으로 하며, 그 정치적 중립성은 준수된다.', 46000, 190, 88, false);
insert into product (project_id, title, description, price, quantity_supplied, quantity_remained, deleted) values (26, '되직한 아르헨티나', '감사원은 세입·세출의 결산을 매년 검사하여 대통령과 차년도국회에 그 결과를 보고하여야 한다. 정당의 설립은 자유이며, 복수정당제는 보장된다. 행정권은 대통령을 수반으로 하는 정부에', 31000, 460, 257, false);
insert into product (project_id, title, description, price, quantity_supplied, quantity_remained, deleted) values (26, '고들고들한 몰도바', '대통령은 조약을 체결·비준하고, 외교사절을 신임·접수 또는 파견하며, 선전포고와 강화를 한다. 헌법재판소에서 법률의 위헌결정, 탄핵의 결정, 정당해산의 결정 또는 헌법소원에 관한 ', 36000, 410, 410, false);
insert into product (project_id, title, description, price, quantity_supplied, quantity_remained, deleted) values (27, '씁쓰름한 싱가포르', '모든 국민은 헌법과 법률이 정한 법관에 의하여 법률에 의한 재판을 받을 권리를 가진다. 모든 국민은 법률이 정하는 바에 의하여 납세의 의무를 진다. 새로운 회계연도가 개시될 때까지', 20000, 240, 120, false);
insert into product (project_id, title, description, price, quantity_supplied, quantity_remained, deleted) values (27, '되직한 스페인', '중앙선거관리위원회는 법령의 범위안에서 선거관리·국민투표관리 또는 정당사무에 관한 규칙을 제정할 수 있으며, 법률에 저촉되지 아니하는 범위안에서 내부규율에 관한 규칙을 제정할 수 있', 22000, 200, 103, false);
insert into product (project_id, title, description, price, quantity_supplied, quantity_remained, deleted) values (27, '되직한 보스니아 헤르체고비나', '국회의 정기회는 법률이 정하는 바에 의하여 매년 1회 집회되며, 국회의 임시회는 대통령 또는 국회재적의원 4분의 1 이상의 요구에 의하여 집회된다. 평화통일정책의 수립에 관한 대통', 20000, 350, 157, false);
insert into product (project_id, title, description, price, quantity_supplied, quantity_remained, deleted) values (27, '짭짤한 라이베리아', '국가안전보장회의의 조직·직무범위 기타 필요한 사항은 법률로 정한다. 언론·출판에 대한 허가나 검열과 집회·결사에 대한 허가는 인정되지 아니한다.', 20000, 380, 168, false);
insert into product (project_id, title, description, price, quantity_supplied, quantity_remained, deleted) values (28, '담백한 키프로스', '모든 국민은 신체의 자유를 가진다. 누구든지 법률에 의하지 아니하고는 체포·구속·압수·수색 또는 심문을 받지 아니하며, 법률과 적법한 절차에 의하지 아니하고는 처벌·보안처분 또는 ', 20000, 220, 82, false);
