insert into product (project_id, title, description, price, quantity_supplied, quantity_remained, deleted) values (29, '매콤한 인도네시아', '탄핵소추의 의결을 받은 자는 탄핵심판이 있을 때까지 그 권한행사가 정지된다. 선거에 있어서 최고득표자가 2인 이상인 때에는 국회의 재적의원 과반수가 출석한 공개회의에서 다수표를 얻', 5000, 400, 291, false);
