insert into product (project_id, title, description, price, quantity_supplied, quantity_remained, deleted) values (33, '바삭바삭한 네팔', '이 헌법시행 당시의 법령과 조약은 이 헌법에 위배되지 아니하는 한 그 효력을 지속한다. 법률이 헌법에 위반되는 여부가 재판의 전제가 된 경우에는 법원은 헌법재판소에 제청하여 그 심', 7000, 160, 82, false);
