insert into product (project_id, title, description, price, quantity_supplied, quantity_remained, deleted) values (34, '씁쓰름한 튀니지', '대법원장과 대법관이 아닌 법관은 대법관회의의 동의를 얻어 대법원장이 임명한다. 대통령은 법률에서 구체적으로 범위를 정하여 위임받은 사항과 법률을 집행하기 위하여 필요한 사항에 관하', 40000, 200, 109, false);
insert into product (project_id, title, description, price, quantity_supplied, quantity_remained, deleted) values (34, '짭짤한 사하라 아랍 민주 공화국', '모든 국민은 건강하고 쾌적한 환경에서 생활할 권리를 가지며, 국가와 국민은 환경보전을 위하여 노력하여야 한다. 국회에서 의결된 법률안은 정부에 이송되어 15일 이내에 대통령이 공포', 24000, 410, 198, false);
insert into product (project_id, title, description, price, quantity_supplied, quantity_remained, deleted) values (35, '매콤한 중화민국', '국토와 자원은 국가의 보호를 받으며, 국가는 그 균형있는 개발과 이용을 위하여 필요한 계획을 수립한다. 국회는 법률에 저촉되지 아니하는 범위안에서 의사와 내부규율에 관한 규칙을 제', 17000, 420, 209, false);
insert into product (project_id, title, description, price, quantity_supplied, quantity_remained, deleted) values (35, '매콤한 리히텐슈타인', '제2항과 제3항의 처분에 대하여는 법원에 제소할 수 없다. 법률이 헌법에 위반되는 여부가 재판의 전제가 된 경우에는 법원은 헌법재판소에 제청하여 그 심판에 의하여 재판한다.', 38000, 190, 76, false);
insert into product (project_id, title, description, price, quantity_supplied, quantity_remained, deleted) values (35, '개운한 뉴질랜드', '국회의원의 수는 법률로 정하되, 200인 이상으로 한다. 여자의 근로는 특별한 보호를 받으며, 고용·임금 및 근로조건에 있어서 부당한 차별을 받지 아니한다.', 29000, 420, 188, false);
insert into product (project_id, title, description, price, quantity_supplied, quantity_remained, deleted) values (35, '오동통한 코스타리카', '국가는 농수산물의 수급균형과 유통구조의 개선에 노력하여 가격안정을 도모함으로써 농·어민의 이익을 보호한다. 군사재판을 관할하기 위하여 특별법원으로서 군사법원을 둘 수 있다.', 13000, 440, 145, false);
insert into product (project_id, title, description, price, quantity_supplied, quantity_remained, deleted) values (36, '짭조름한 그리스', '법관은 헌법과 법률에 의하여 그 양심에 따라 독립하여 심판한다. 모든 국민은 법률이 정하는 바에 의하여 납세의 의무를 진다. 국정감사 및 조사에 관한 절차 기타 필요한 사항은 법률', 6000, 480, 237, false);
insert into product (project_id, title, description, price, quantity_supplied, quantity_remained, deleted) values (36, '바삭바삭한 에콰도르', '대법관의 임기는 6년으로 하며, 법률이 정하는 바에 의하여 연임할 수 있다. 지방의회의 조직·권한·의원선거와 지방자치단체의 장의 선임방법 기타 지방자치단체의 조직과 운영에 관한 사', 19000, 230, 107, false);
insert into product (project_id, title, description, price, quantity_supplied, quantity_remained, deleted) values (36, '담백한 브루나이', '공공필요에 의한 재산권의 수용·사용 또는 제한 및 그에 대한 보상은 법률로써 하되, 정당한 보상을 지급하여야 한다. 법관이 중대한 심신상의 장해로 직무를 수행할 수 없을 때에는 법', 26000, 130, 66, false);
insert into product (project_id, title, description, price, quantity_supplied, quantity_remained, deleted) values (36, '매콤한 모나코', '공무원인 근로자는 법률이 정하는 자에 한하여 단결권·단체교섭권 및 단체행동권을 가진다. 모든 국민의 재산권은 보장된다. 그 내용과 한계는 법률로 정한다.', 6000, 300, 153, false);
