insert into product (project_id, title, description, price, quantity_supplied, quantity_remained, deleted) values (37, '개운한 나미비아', '대통령은 내란 또는 외환의 죄를 범한 경우를 제외하고는 재직중 형사상의 소추를 받지 아니한다. 국군의 조직과 편성은 법률로 정한다. 사법권은 법관으로 구성된 법원에 속한다.', 23000, 190, 82, false);
