insert into product (project_id, title, description, price, quantity_supplied, quantity_remained, deleted) values (38, '새콤달콤한 온두라스', '헌법재판소는 법관의 자격을 가진 9인의 재판관으로 구성하며, 재판관은 대통령이 임명한다. 국회는 정부의 동의없이 정부가 제출한 지출예산 각항의 금액을 증가하거나 새 비목을 설치할 ', 22000, 260, 181, false);
insert into product (project_id, title, description, price, quantity_supplied, quantity_remained, deleted) values (38, '매콤한 바베이도스', '국가안전보장에 관련되는 대외정책·군사정책과 국내정책의 수립에 관하여 국무회의의 심의에 앞서 대통령의 자문에 응하기 위하여 국가안전보장회의를 둔다.', 35000, 220, 220, false);
insert into product (project_id, title, description, price, quantity_supplied, quantity_remained, deleted) values (38, '짭짤한 몽골', '누구든지 체포 또는 구속을 당한 때에는 적부의 심사를 법원에 청구할 권리를 가진다. 대법원장과 대법관이 아닌 법관은 대법관회의의 동의를 얻어 대법원장이 임명한다.', 8000, 200, 104, false);
