insert into product (project_id, title, description, price, quantity_supplied, quantity_remained, deleted) values (39, '되직한 쿠웨이트', '국무위원은 국무총리의 제청으로 대통령이 임명한다. 헌법에 의하여 체결·공포된 조약과 일반적으로 승인된 국제법규는 국내법과 같은 효력을 가진다.', 5000, 280, 113, false);
insert into product (project_id, title, description, price, quantity_supplied, quantity_remained, deleted) values (39, '달콤한 모로코', '이 헌법시행 당시에 이 헌법에 의하여 새로 설치될 기관의 권한에 속하는 직무를 행하고 있는 기관은 이 헌법에 의하여 새로운 기관이 설치될 때까지 존속하며 그 직무를 행한다.', 32000, 230, 108, false);
