insert into product (project_id, title, description, price, quantity_supplied, quantity_remained, deleted) values (40, '짭짤한 그레나다', '대통령·국무총리·국무위원·행정각부의 장·헌법재판소 재판관·법관·중앙선거관리위원회 위원·감사원장·감사위원 기타 법률이 정한 공무원이 그 직무집행에 있어서 헌법이나 법률을 위배한 때에', 28000, 240, 48, false);
