insert into product (project_id, title, description, price, quantity_supplied, quantity_remained, deleted) values (40, '매콤한 태국', '국가는 재해를 예방하고 그 위험으로부터 국민을 보호하기 위하여 노력하여야 한다. 국가는 농·어민과 중소기업의 자조조직을 육성하여야 하며, 그 자율적 활동과 발전을 보장한다.', 40000, 450, 244, false);
