insert into product (project_id, title, description, price, quantity_supplied, quantity_remained, deleted) values (44, '바삭바삭한 에티오피아', '탄핵결정은 공직으로부터 파면함에 그친다. 그러나, 이에 의하여 민사상이나 형사상의 책임이 면제되지는 아니한다. 원장은 국회의 동의를 얻어 대통령이 임명하고, 그 임기는 4년으로 하', 45000, 250, 94, false);
insert into product (project_id, title, description, price, quantity_supplied, quantity_remained, deleted) values (44, '되직한 요르단', '국가는 전통문화의 계승·발전과 민족문화의 창달에 노력하여야 한다. 타인의 범죄행위로 인하여 생명·신체에 대한 피해를 받은 국민은 법률이 정하는 바에 의하여 국가로부터 구조를 받을 ', 32000, 110, 53, false);
