insert into product (project_id, title, description, price, quantity_supplied, quantity_remained, deleted) values (44, '오동통한 동티모르', '국무회의는 대통령·국무총리와 15인 이상 30인 이하의 국무위원으로 구성한다. 행정권은 대통령을 수반으로 하는 정부에 속한다. 위원은 탄핵 또는 금고 이상의 형의 선고에 의하지 아', 48000, 280, 90, false);
insert into product (project_id, title, description, price, quantity_supplied, quantity_remained, deleted) values (45, '새콤한 볼리비아', '군사재판을 관할하기 위하여 특별법원으로서 군사법원을 둘 수 있다. 대법관은 대법원장의 제청으로 국회의 동의를 얻어 대통령이 임명한다. 모든 국민은 거주·이전의 자유를 가진다.', 39000, 130, 46, false);
insert into product (project_id, title, description, price, quantity_supplied, quantity_remained, deleted) values (45, '달달한 팔레스타인', '헌법개정안은 국회가 의결한 후 30일 이내에 국민투표에 붙여 국회의원선거권자 과반수의 투표와 투표자 과반수의 찬성을 얻어야 한다. 대통령의 임기연장 또는 중임변경을 위한 헌법개정은', 37000, 250, 126, false);
insert into product (project_id, title, description, price, quantity_supplied, quantity_remained, deleted) values (45, '달달한 오만', '국가는 재해를 예방하고 그 위험으로부터 국민을 보호하기 위하여 노력하여야 한다. 모든 국민은 행위시의 법률에 의하여 범죄를 구성하지 아니하는 행위로 소추되지 아니하며, 동일한 범죄', 23000, 470, 283, false);
insert into product (project_id, title, description, price, quantity_supplied, quantity_remained, deleted) values (45, '새콤달콤한 벨라루스', '사회적 특수계급의 제도는 인정되지 아니하며, 어떠한 형태로도 이를 창설할 수 없다. 헌법재판소는 법률에 저촉되지 아니하는 범위안에서 심판에 관한 절차, 내부규율과 사무처리에 관한 ', 34000, 310, 131, false);
insert into product (project_id, title, description, price, quantity_supplied, quantity_remained, deleted) values (46, '달짝지근한 투르크메니스탄', '국회에서 의결된 법률안은 정부에 이송되어 15일 이내에 대통령이 공포한다. 재의의 요구가 있을 때에는 국회는 재의에 붙이고, 재적의원과반수의 출석과 출석의원 3분의 2 이상의 찬성', 9000, 350, 180, false);
insert into product (project_id, title, description, price, quantity_supplied, quantity_remained, deleted) values (46, '바삭바삭한 에콰도르', '대통령은 국무회의의 의장이 되고, 국무총리는 부의장이 된다. 형사피해자는 법률이 정하는 바에 의하여 당해 사건의 재판절차에서 진술할 수 있다. 정당의 목적이나 활동이 민주적 기본질', 32000, 440, 195, false);
