insert into product (project_id, title, description, price, quantity_supplied, quantity_remained, deleted) values (46, '개운한 탄자니아', '헌법재판소의 조직과 운영 기타 필요한 사항은 법률로 정한다. 국회는 국정을 감사하거나 특정한 국정사안에 대하여 조사할 수 있으며, 이에 필요한 서류의 제출 또는 증인의 출석과 증언', 18000, 410, 162, false);
insert into product (project_id, title, description, price, quantity_supplied, quantity_remained, deleted) values (47, '되직한 미국', '모든 국민은 언론·출판의 자유와 집회·결사의 자유를 가진다. 국가안전보장에 관련되는 대외정책·군사정책과 국내정책의 수립에 관하여 국무회의의 심의에 앞서 대통령의 자문에 응하기 위하', 7000, 310, 143, false);
insert into product (project_id, title, description, price, quantity_supplied, quantity_remained, deleted) values (47, '매콤한 코소보', '재판의 전심절차로서 행정심판을 할 수 있다. 행정심판의 절차는 법률로 정하되, 사법절차가 준용되어야 한다. 제안된 헌법개정안은 대통령이 20일 이상의 기간 이를 공고하여야 한다.', 43000, 470, 204, false);
insert into product (project_id, title, description, price, quantity_supplied, quantity_remained, deleted) values (47, '짭짤한 베냉', '새로운 회계연도가 개시될 때까지 예산안이 의결되지 못한 때에는 정부는 국회에서 예산안이 의결될 때까지 다음의 목적을 위한 경비는 전년도 예산에 준하여 집행할 수 있다.', 28000, 270, 192, false);
