insert into product (project_id, title, description, price, quantity_supplied, quantity_remained, deleted) values (48, '달달한 카자흐스탄', '대통령이 궐위되거나 사고로 인하여 직무를 수행할 수 없을 때에는 국무총리, 법률이 정한 국무위원의 순서로 그 권한을 대행한다. 모든 국민은 신체의 자유를 가진다. 누구든지 법률에 ', 38000, 400, 199, false);
