insert into product (project_id, title, description, price, quantity_supplied, quantity_remained, deleted) values (48, '매콤한 중화민국', '원장은 국회의 동의를 얻어 대통령이 임명하고, 그 임기는 4년으로 하며, 1차에 한하여 중임할 수 있다. 모든 국민은 법률이 정하는 바에 의하여 납세의 의무를 진다.', 47000, 240, 172, false);
insert into product (project_id, title, description, price, quantity_supplied, quantity_remained, deleted) values (49, '담백한 스웨덴', '국가원로자문회의의 조직·직무범위 기타 필요한 사항은 법률로 정한다. 대한민국은 통일을 지향하며, 자유민주적 기본질서에 입각한 평화적 통일 정책을 수립하고 이를 추진한다.', 13000, 480, 210, false);
insert into product (project_id, title, description, price, quantity_supplied, quantity_remained, deleted) values (49, '달달한 헝가리', '헌법재판소는 법관의 자격을 가진 9인의 재판관으로 구성하며, 재판관은 대통령이 임명한다. 정기회의 회기는 100일을, 임시회의 회기는 30일을 초과할 수 없다.', 37000, 420, 200, false);
