insert into product (project_id, title, description, price, quantity_supplied, quantity_remained, deleted) values (50, '새콤한 파키스탄', '근로조건의 기준은 인간의 존엄성을 보장하도록 법률로 정한다. 국무위원은 국무총리의 제청으로 대통령이 임명한다. 대통령은 제3항과 제4항의 사유를 지체없이 공포하여야 한다.', 17000, 230, 108, false);
