insert into product (project_id, title, description, price, quantity_supplied, quantity_remained, deleted) values (50, '짭짤한 라이베리아', '국가는 과학기술의 혁신과 정보 및 인력의 개발을 통하여 국민경제의 발전에 노력하여야 한다. 국가는 재해를 예방하고 그 위험으로부터 국민을 보호하기 위하여 노력하여야 한다.', 37000, 190, 102, false);
insert into product (project_id, title, description, price, quantity_supplied, quantity_remained, deleted) values (51, '달달한 필리핀', '전직대통령의 신분과 예우에 관하여는 법률로 정한다. 국회는 상호원조 또는 안전보장에 관한 조약, 중요한 국제조직에 관한 조약, 우호통상항해조약, 주권의 제약에 관한 조약, 강화조약', 14000, 500, 280, false);
