insert into product (project_id, title, description, price, quantity_supplied, quantity_remained, deleted) values (51, '시큼한 가봉', '비상계엄이 선포된 때에는 법률이 정하는 바에 의하여 영장제도, 언론·출판·집회·결사의 자유, 정부나 법원의 권한에 관하여 특별한 조치를 할 수 있다.', 30000, 290, 144, false);
insert into product (project_id, title, description, price, quantity_supplied, quantity_remained, deleted) values (51, '달짝지근한 토고', '법률은 특별한 규정이 없는 한 공포한 날로부터 20일을 경과함으로써 효력을 발생한다. 공무원의 신분과 정치적 중립성은 법률이 정하는 바에 의하여 보장된다.', 35000, 310, 171, false);
insert into product (project_id, title, description, price, quantity_supplied, quantity_remained, deleted) values (52, '달콤한 벨리즈', '국회의원은 현행범인인 경우를 제외하고는 회기중 국회의 동의없이 체포 또는 구금되지 아니한다. 대통령은 필요하다고 인정할 때에는 외교·국방·통일 기타 국가안위에 관한 중요정책을 국민', 18000, 120, 65, false);
