insert into product (project_id, title, description, price, quantity_supplied, quantity_remained, deleted) values (52, '짭짤한 기니', '국가원로자문회의의 조직·직무범위 기타 필요한 사항은 법률로 정한다. 국회의원이 회기전에 체포 또는 구금된 때에는 현행범인이 아닌 한 국회의 요구가 있으면 회기중 석방된다.', 34000, 200, 87, false);
