insert into product (project_id, title, description, price, quantity_supplied, quantity_remained, deleted) values (53, '되직한 스위스', '모든 국민은 법 앞에 평등하다. 누구든지 성별·종교 또는 사회적 신분에 의하여 정치적·경제적·사회적·문화적 생활의 모든 영역에 있어서 차별을 받지 아니한다.', 43000, 200, 99, false);
insert into product (project_id, title, description, price, quantity_supplied, quantity_remained, deleted) values (54, '짭짤한 스와질란드', '모든 국민은 법률이 정하는 바에 의하여 납세의 의무를 진다. 타인의 범죄행위로 인하여 생명·신체에 대한 피해를 받은 국민은 법률이 정하는 바에 의하여 국가로부터 구조를 받을 수 있', 30000, 100, 35, false);
