insert into product (project_id, title, description, price, quantity_supplied, quantity_remained, deleted) values (62, '달짝지근한 투르크메니스탄', '제2항과 제3항의 처분에 대하여는 법원에 제소할 수 없다. 모든 국민은 사생활의 비밀과 자유를 침해받지 아니한다. 대통령은 법률안의 일부에 대하여 또는 법률안을 수정하여 재의를 요', 43000, 290, 116, false);
