insert into product (project_id, title, description, price, quantity_supplied, quantity_remained, deleted) values (62, '간간한 캄보디아', '형사피고인은 유죄의 판결이 확정될 때까지는 무죄로 추정된다. 제1항의 지시를 받은 당해 행정기관은 이에 응하여야 한다. 국가안전보장회의의 조직·직무범위 기타 필요한 사항은 법률로 ', 12000, 180, 94, false);
insert into product (project_id, title, description, price, quantity_supplied, quantity_remained, deleted) values (63, '달달한 아르메니아', '형사피의자 또는 형사피고인으로서 구금되었던 자가 법률이 정하는 불기소처분을 받거나 무죄판결을 받은 때에는 법률이 정하는 바에 의하여 국가에 정당한 보상을 청구할 수 있다.', 12000, 110, 43, false);
insert into product (project_id, title, description, price, quantity_supplied, quantity_remained, deleted) values (63, '시큼한 수리남', '국가원로자문회의의 의장은 직전대통령이 된다. 다만, 직전대통령이 없을 때에는 대통령이 지명한다. 재산권의 행사는 공공복리에 적합하도록 하여야 한다.', 29000, 360, 171, false);
