insert into product (project_id, title, description, price, quantity_supplied, quantity_remained, deleted) values (63, '시큼한 슬로바키아', '국회는 법률에 저촉되지 아니하는 범위안에서 의사와 내부규율에 관한 규칙을 제정할 수 있다. 국가안전보장에 관련되는 대외정책·군사정책과 국내정책의 수립에 관하여 국무회의의 심의에 앞', 46000, 170, 78, false);
insert into product (project_id, title, description, price, quantity_supplied, quantity_remained, deleted) values (64, '오동통한 트란스니스트리아', '새로운 회계연도가 개시될 때까지 예산안이 의결되지 못한 때에는 정부는 국회에서 예산안이 의결될 때까지 다음의 목적을 위한 경비는 전년도 예산에 준하여 집행할 수 있다.', 8000, 370, 148, false);
