insert into product (project_id, title, description, price, quantity_supplied, quantity_remained, deleted) values (64, '씁쓰름한 싱가포르', '모든 국민은 법 앞에 평등하다. 누구든지 성별·종교 또는 사회적 신분에 의하여 정치적·경제적·사회적·문화적 생활의 모든 영역에 있어서 차별을 받지 아니한다.', 32000, 230, 111, false);
insert into product (project_id, title, description, price, quantity_supplied, quantity_remained, deleted) values (64, '짭조름한 몬테네그로', '대한민국은 민주공화국이다. 법률이 정하는 주요방위산업체에 종사하는 근로자의 단체행동권은 법률이 정하는 바에 의하여 이를 제한하거나 인정하지 아니할 수 있다.', 27000, 360, 163, false);
