insert into product (project_id, title, description, price, quantity_supplied, quantity_remained, deleted) values (65, '시큼한 부룬디', '모든 국민은 거주·이전의 자유를 가진다. 국교는 인정되지 아니하며, 종교와 정치는 분리된다. 국무위원은 국무총리의 제청으로 대통령이 임명한다. 대한민국은 국제평화의 유지에 노력하고', 6000, 310, 155, false);
