insert into product (project_id, title, description, price, quantity_supplied, quantity_remained, deleted) values (71, '되직한 가나', '대통령이 임시회의 집회를 요구할 때에는 기간과 집회요구의 이유를 명시하여야 한다. 헌법재판소에서 법률의 위헌결정, 탄핵의 결정, 정당해산의 결정 또는 헌법소원에 관한 인용결정을 할', 32000, 300, 65, false);
