insert into product (project_id, title, description, price, quantity_supplied, quantity_remained, deleted) values (72, '새콤달콤한 벨라루스', '누구든지 체포 또는 구속을 당한 때에는 적부의 심사를 법원에 청구할 권리를 가진다. 국무회의는 정부의 권한에 속하는 중요한 정책을 심의한다. 국무총리는 국회의 동의를 얻어 대통령이', 40000, 200, 104, false);
