insert into product (project_id, title, description, price, quantity_supplied, quantity_remained, deleted) values (73, '씁쓰름한 튀니지', '국회는 의원의 자격을 심사하며, 의원을 징계할 수 있다. 모든 국민은 행위시의 법률에 의하여 범죄를 구성하지 아니하는 행위로 소추되지 아니하며, 동일한 범죄에 대하여 거듭 처벌받지', 21000, 220, 73, false);
