insert into product (project_id, title, description, price, quantity_supplied, quantity_remained, deleted) values (75, '새콤달콤한 리비아', '국회의원의 선거구와 비례대표제 기타 선거에 관한 사항은 법률로 정한다. 국무총리는 대통령을 보좌하며, 행정에 관하여 대통령의 명을 받아 행정각부를 통할한다.', 33000, 100, 38, false);
insert into product (project_id, title, description, price, quantity_supplied, quantity_remained, deleted) values (76, '담백한 몰타', '모든 국민은 보건에 관하여 국가의 보호를 받는다. 선거와 국민투표의 공정한 관리 및 정당에 관한 사무를 처리하기 위하여 선거관리위원회를 둔다. 대통령의 국법상 행위는 문서로써 하며', 31000, 110, 45, false);
