insert into product (project_id, title, description, price, quantity_supplied, quantity_remained, deleted) values (80, '되직한 가나', '근로자는 근로조건의 향상을 위하여 자주적인 단결권·단체교섭권 및 단체행동권을 가진다. 군인은 현역을 면한 후가 아니면 국무총리로 임명될 수 없다.', 23000, 390, 160, false);
insert into product (project_id, title, description, price, quantity_supplied, quantity_remained, deleted) values (80, '개운한 뉴질랜드', '대한민국의 영토는 한반도와 그 부속도서로 한다. 대통령이 제1항의 기간내에 공포나 재의의 요구를 하지 아니한 때에도 그 법률안은 법률로서 확정된다.', 20000, 140, 59, false);
insert into product (project_id, title, description, price, quantity_supplied, quantity_remained, deleted) values (80, '오동통한 파라과이', '정당의 목적이나 활동이 민주적 기본질서에 위배될 때에는 정부는 헌법재판소에 그 해산을 제소할 수 있고, 정당은 헌법재판소의 심판에 의하여 해산된다.', 23000, 250, 128, false);
insert into product (project_id, title, description, price, quantity_supplied, quantity_remained, deleted) values (81, '되직한 아르헨티나', '헌법재판소 재판관의 임기는 6년으로 하며, 법률이 정하는 바에 의하여 연임할 수 있다. 행정각부의 장은 국무위원 중에서 국무총리의 제청으로 대통령이 임명한다.', 38000, 160, 67, false);
insert into product (project_id, title, description, price, quantity_supplied, quantity_remained, deleted) values (81, '오동통한 트란스니스트리아', '국회는 헌법개정안이 공고된 날로부터 60일 이내에 의결하여야 하며, 국회의 의결은 재적의원 3분의 2 이상의 찬성을 얻어야 한다. 대통령은 제4항과 제5항의 규정에 의하여 확정된 ', 49000, 400, 103, false);
insert into product (project_id, title, description, price, quantity_supplied, quantity_remained, deleted) values (81, '고들고들한 가이아나', '군인·군무원·경찰공무원 기타 법률이 정하는 자가 전투·훈련등 직무집행과 관련하여 받은 손해에 대하여는 법률이 정하는 보상외에 국가 또는 공공단체에 공무원의 직무상 불법행위로 인한 ', 42000, 340, 135, false);
insert into product (project_id, title, description, price, quantity_supplied, quantity_remained, deleted) values (81, '달달한 오만', '혼인과 가족생활은 개인의 존엄과 양성의 평등을 기초로 성립되고 유지되어야 하며, 국가는 이를 보장한다. 모든 국민은 자기의 행위가 아닌 친족의 행위로 인하여 불이익한 처우를 받지 ', 40000, 180, 64, false);
insert into product (project_id, title, description, price, quantity_supplied, quantity_remained, deleted) values (82, '짭조름한 기니비사우', '비상계엄이 선포된 때에는 법률이 정하는 바에 의하여 영장제도, 언론·출판·집회·결사의 자유, 정부나 법원의 권한에 관하여 특별한 조치를 할 수 있다.', 36000, 470, 379, false);
insert into product (project_id, title, description, price, quantity_supplied, quantity_remained, deleted) values (82, '새콤한 우크라이나', '국가는 농수산물의 수급균형과 유통구조의 개선에 노력하여 가격안정을 도모함으로써 농·어민의 이익을 보호한다. 법률안에 이의가 있을 때에는 대통령은 제1항의 기간내에 이의서를 붙여 국', 48000, 390, 190, false);
insert into product (project_id, title, description, price, quantity_supplied, quantity_remained, deleted) values (82, '담백한 스리랑카', '대한민국의 영토는 한반도와 그 부속도서로 한다. 전직대통령의 신분과 예우에 관하여는 법률로 정한다. 국가는 균형있는 국민경제의 성장 및 안정과 적정한 소득의 분배를 유지하고, 시장', 6000, 140, 66, false);
insert into product (project_id, title, description, price, quantity_supplied, quantity_remained, deleted) values (82, '고들고들한 가이아나', '국가는 사회보장·사회복지의 증진에 노력할 의무를 진다. 대통령의 선거에 관한 사항은 법률로 정한다. 나는 헌법을 준수하고 국가를 보위하며 조국의 평화적 통일과 국민의 자유와 복리의', 48000, 260, 134, false);
insert into product (project_id, title, description, price, quantity_supplied, quantity_remained, deleted) values (83, '달짝지근한 앤티가 바부다', '이 헌법시행 당시의 법령과 조약은 이 헌법에 위배되지 아니하는 한 그 효력을 지속한다. 언론·출판에 대한 허가나 검열과 집회·결사에 대한 허가는 인정되지 아니한다.', 40000, 160, 77, false);
insert into product (project_id, title, description, price, quantity_supplied, quantity_remained, deleted) values (83, '짭짤한 이스라엘', '평화통일정책의 수립에 관한 대통령의 자문에 응하기 위하여 민주평화통일자문회의를 둘 수 있다. 국가는 법률이 정하는 바에 의하여 재외국민을 보호할 의무를 진다.', 44000, 270, 127, false);
insert into product (project_id, title, description, price, quantity_supplied, quantity_remained, deleted) values (83, '담백한 베트남', '국군은 국가의 안전보장과 국토방위의 신성한 의무를 수행함을 사명으로 하며, 그 정치적 중립성은 준수된다. 대통령은 전시·사변 또는 이에 준하는 국가비상사태에 있어서 병력으로써 군사', 22000, 340, 156, false);
insert into product (project_id, title, description, price, quantity_supplied, quantity_remained, deleted) values (83, '달콤한 괌', '국회에서 의결된 법률안은 정부에 이송되어 15일 이내에 대통령이 공포한다. 국가는 농업 및 어업을 보호·육성하기 위하여 농·어촌종합개발과 그 지원등 필요한 계획을 수립·시행하여야 ', 17000, 440, 289, false);
insert into product (project_id, title, description, price, quantity_supplied, quantity_remained, deleted) values (84, '짭짤한 이스라엘', '대법원은 법률에 저촉되지 아니하는 범위안에서 소송에 관한 절차, 법원의 내부규율과 사무처리에 관한 규칙을 제정할 수 있다. 대통령의 임기는 5년으로 하며, 중임할 수 없다.', 11000, 190, 84, false);
