insert into product (project_id, title, description, price, quantity_supplied, quantity_remained, deleted) values (85, '짭조름한 차드', '국무위원은 국무총리의 제청으로 대통령이 임명한다. 선거운동은 각급 선거관리위원회의 관리하에 법률이 정하는 범위안에서 하되, 균등한 기회가 보장되어야 한다.', 34000, 170, 93, false);
