insert into product (project_id, title, description, price, quantity_supplied, quantity_remained, deleted) values (86, '매콤한 말레이시아', '공무원의 직무상 불법행위로 손해를 받은 국민은 법률이 정하는 바에 의하여 국가 또는 공공단체에 정당한 배상을 청구할 수 있다. 이 경우 공무원 자신의 책임은 면제되지 아니한다.', 46000, 150, 58, false);
