insert into product (project_id, title, description, price, quantity_supplied, quantity_remained, deleted) values (98, '매콤한 베네수엘라', '대한민국의 경제질서는 개인과 기업의 경제상의 자유와 창의를 존중함을 기본으로 한다. 대한민국의 영토는 한반도와 그 부속도서로 한다. 교육의 자주성·전문성·정치적 중립성 및 대학의 ', 43000, 490, 268, false);
insert into product (project_id, title, description, price, quantity_supplied, quantity_remained, deleted) values (99, '되직한 부르키나파소', '모든 국민은 사생활의 비밀과 자유를 침해받지 아니한다. 선거에 관한 경비는 법률이 정하는 경우를 제외하고는 정당 또는 후보자에게 부담시킬 수 없다.', 21000, 120, 60, false);
insert into product (project_id, title, description, price, quantity_supplied, quantity_remained, deleted) values (99, '되직한 남아프리카 공화국', '대통령은 내우·외환·천재·지변 또는 중대한 재정·경제상의 위기에 있어서 국가의 안전보장 또는 공공의 안녕질서를 유지하기 위하여 긴급한 조치가 필요하고 국회의 집회를 기다릴 여유가 ', 21000, 360, 210, false);
insert into product (project_id, title, description, price, quantity_supplied, quantity_remained, deleted) values (99, '매콤한 코소보', '군인은 현역을 면한 후가 아니면 국무총리로 임명될 수 없다. 모든 국민은 사생활의 비밀과 자유를 침해받지 아니한다. 국가는 대외무역을 육성하며, 이를 규제·조정할 수 있다.', 31000, 490, 238, false);
insert into product (project_id, title, description, price, quantity_supplied, quantity_remained, deleted) values (99, '짭조름한 압하스', '의원을 제명하려면 국회재적의원 3분의 2 이상의 찬성이 있어야 한다. 대법관의 임기는 6년으로 하며, 법률이 정하는 바에 의하여 연임할 수 있다. 행정권은 대통령을 수반으로 하는 ', 25000, 230, 134, false);
insert into product (project_id, title, description, price, quantity_supplied, quantity_remained, deleted) values (100, '새콤한 코모로', '모든 국민은 거주·이전의 자유를 가진다. 국회는 국무총리 또는 국무위원의 해임을 대통령에게 건의할 수 있다. 국가는 평생교육을 진흥하여야 한다. 대법원장은 국회의 동의를 얻어 대통', 35000, 220, 99, false);
insert into product (project_id, title, description, price, quantity_supplied, quantity_remained, deleted) values (100, '오동통한 러시아', '모든 국민은 종교의 자유를 가진다. 헌법재판소에서 법률의 위헌결정, 탄핵의 결정, 정당해산의 결정 또는 헌법소원에 관한 인용결정을 할 때에는 재판관 6인 이상의 찬성이 있어야 한다', 44000, 450, 242, false);
insert into product (project_id, title, description, price, quantity_supplied, quantity_remained, deleted) values (100, '매콤한 덴마크', '위원은 정당에 가입하거나 정치에 관여할 수 없다. 대통령은 헌법과 법률이 정하는 바에 의하여 공무원을 임면한다. 헌법개정안은 국회가 의결한 후 30일 이내에 국민투표에 붙여 국회의', 5000, 210, 83, false);
insert into product (project_id, title, description, price, quantity_supplied, quantity_remained, deleted) values (100, '달짝지근한 알제리', '모든 국민은 능력에 따라 균등하게 교육을 받을 권리를 가진다. 국회에서 의결된 법률안은 정부에 이송되어 15일 이내에 대통령이 공포한다. 모든 국민은 법 앞에 평등하다. 누구든지 ', 26000, 290, 290, false);
insert into product (project_id, title, description, price, quantity_supplied, quantity_remained, deleted) values (101, '씁쓰름한 아이티', '정당은 그 목적·조직과 활동이 민주적이어야 하며, 국민의 정치적 의사형성에 참여하는데 필요한 조직을 가져야 한다. 대통령이 궐위되거나 사고로 인하여 직무를 수행할 수 없을 때에는 ', 29000, 290, 155, false);
insert into product (project_id, title, description, price, quantity_supplied, quantity_remained, deleted) values (101, '매콤한 코소보', '국회는 국민의 보통·평등·직접·비밀선거에 의하여 선출된 국회의원으로 구성한다. 대통령은 제3항과 제4항의 사유를 지체없이 공포하여야 한다. 대통령은 헌법과 법률이 정하는 바에 의하', 46000, 110, 52, false);
insert into product (project_id, title, description, price, quantity_supplied, quantity_remained, deleted) values (101, '새콤달콤한 트리니다드 토바고', '국회나 그 위원회의 요구가 있을 때에는 국무총리·국무위원 또는 정부위원은 출석·답변하여야 하며, 국무총리 또는 국무위원이 출석요구를 받은 때에는 국무위원 또는 정부위원으로 하여금 ', 30000, 430, 180, false);
insert into product (project_id, title, description, price, quantity_supplied, quantity_remained, deleted) values (101, '달짝지근한 레소토', '정당은 법률이 정하는 바에 의하여 국가의 보호를 받으며, 국가는 법률이 정하는 바에 의하여 정당운영에 필요한 자금을 보조할 수 있다. 위원은 정당에 가입하거나 정치에 관여할 수 없', 42000, 340, 135, false);
insert into product (project_id, title, description, price, quantity_supplied, quantity_remained, deleted) values (102, '짭짤한 세인트키츠 네비스', '대통령이 궐위된 때 또는 대통령 당선자가 사망하거나 판결 기타의 사유로 그 자격을 상실한 때에는 60일 이내에 후임자를 선거한다. 모든 국민은 보건에 관하여 국가의 보호를 받는다.', 28000, 200, 90, false);
insert into product (project_id, title, description, price, quantity_supplied, quantity_remained, deleted) values (102, '달짝지근한 안도라', '계엄을 선포한 때에는 대통령은 지체없이 국회에 통고하여야 한다. 지방의회의 조직·권한·의원선거와 지방자치단체의 장의 선임방법 기타 지방자치단체의 조직과 운영에 관한 사항은 법률로 ', 35000, 260, 105, false);
insert into product (project_id, title, description, price, quantity_supplied, quantity_remained, deleted) values (102, '담백한 콩고 공화국', '모든 국민은 법률이 정하는 바에 의하여 국방의 의무를 진다. 국회의원은 현행범인인 경우를 제외하고는 회기중 국회의 동의없이 체포 또는 구금되지 아니한다.', 21000, 130, 58, false);
insert into product (project_id, title, description, price, quantity_supplied, quantity_remained, deleted) values (102, '되직한 브라질', '대한민국의 주권은 국민에게 있고, 모든 권력은 국민으로부터 나온다. 공무원의 직무상 불법행위로 손해를 받은 국민은 법률이 정하는 바에 의하여 국가 또는 공공단체에 정당한 배상을 청', 38000, 160, 81, false);
insert into product (project_id, title, description, price, quantity_supplied, quantity_remained, deleted) values (103, '담백한 콩고 공화국', '헌법개정은 국회재적의원 과반수 또는 대통령의 발의로 제안된다. 국가는 모성의 보호를 위하여 노력하여야 한다. 국가의 세입·세출의 결산, 국가 및 법률이 정한 단체의 회계검사와 행정', 9000, 410, 220, false);
