insert into product (project_id, title, description, price, quantity_supplied, quantity_remained, deleted) values (103, '되직한 쿠웨이트', '제2항의 재판관중 3인은 국회에서 선출하는 자를, 3인은 대법원장이 지명하는 자를 임명한다. 공공필요에 의한 재산권의 수용·사용 또는 제한 및 그에 대한 보상은 법률로써 하되, 정', 44000, 130, 62, false);
insert into product (project_id, title, description, price, quantity_supplied, quantity_remained, deleted) values (103, '담백한 독일', '선거에 관한 경비는 법률이 정하는 경우를 제외하고는 정당 또는 후보자에게 부담시킬 수 없다. 국가안전보장에 관련되는 대외정책·군사정책과 국내정책의 수립에 관하여 국무회의의 심의에 ', 48000, 330, 188, false);
insert into product (project_id, title, description, price, quantity_supplied, quantity_remained, deleted) values (104, '담백한 키프로스', '공공필요에 의한 재산권의 수용·사용 또는 제한 및 그에 대한 보상은 법률로써 하되, 정당한 보상을 지급하여야 한다. 모든 국민은 인간다운 생활을 할 권리를 가진다.', 30000, 110, 43, false);
insert into product (project_id, title, description, price, quantity_supplied, quantity_remained, deleted) values (104, '씁쓰름한 카보베르데', '사회적 특수계급의 제도는 인정되지 아니하며, 어떠한 형태로도 이를 창설할 수 없다. 모든 국민은 신속한 재판을 받을 권리를 가진다. 형사피고인은 상당한 이유가 없는 한 지체없이 공', 26000, 480, 250, false);
insert into product (project_id, title, description, price, quantity_supplied, quantity_remained, deleted) values (104, '씁쓰름한 도미니카', '새로운 회계연도가 개시될 때까지 예산안이 의결되지 못한 때에는 정부는 국회에서 예산안이 의결될 때까지 다음의 목적을 위한 경비는 전년도 예산에 준하여 집행할 수 있다.', 10000, 300, 107, false);
insert into product (project_id, title, description, price, quantity_supplied, quantity_remained, deleted) values (104, '짭조름한 일본', '국민경제의 발전을 위한 중요정책의 수립에 관하여 대통령의 자문에 응하기 위하여 국민경제자문회의를 둘 수 있다. 대통령이 임시회의 집회를 요구할 때에는 기간과 집회요구의 이유를 명시', 37000, 320, 185, false);
