insert into product (project_id, title, description, price, quantity_supplied, quantity_remained, deleted) values (107, '시큼한 룩셈부르크', '군인·군무원·경찰공무원 기타 법률이 정하는 자가 전투·훈련등 직무집행과 관련하여 받은 손해에 대하여는 법률이 정하는 보상외에 국가 또는 공공단체에 공무원의 직무상 불법행위로 인한 ', 18000, 380, 189, false);
insert into product (project_id, title, description, price, quantity_supplied, quantity_remained, deleted) values (107, '매콤한 북키프로스', '재산권의 행사는 공공복리에 적합하도록 하여야 한다. 이 헌법시행 당시에 이 헌법에 의하여 새로 설치될 기관의 권한에 속하는 직무를 행하고 있는 기관은 이 헌법에 의하여 새로운 기관', 16000, 410, 188, false);
insert into product (project_id, title, description, price, quantity_supplied, quantity_remained, deleted) values (107, '개운한 앙골라', '계엄을 선포한 때에는 대통령은 지체없이 국회에 통고하여야 한다. 국가유공자·상이군경 및 전몰군경의 유가족은 법률이 정하는 바에 의하여 우선적으로 근로의 기회를 부여받는다.', 39000, 390, 123, false);
insert into product (project_id, title, description, price, quantity_supplied, quantity_remained, deleted) values (108, '씁쓰름한 카보베르데', '나는 헌법을 준수하고 국가를 보위하며 조국의 평화적 통일과 국민의 자유와 복리의 증진 및 민족문화의 창달에 노력하여 대통령으로서의 직책을 성실히 수행할 것을 국민 앞에 엄숙히 선서', 13000, 270, 153, false);
insert into product (project_id, title, description, price, quantity_supplied, quantity_remained, deleted) values (108, '달달한 아르메니아', '위원은 정당에 가입하거나 정치에 관여할 수 없다. 정기회의 회기는 100일을, 임시회의 회기는 30일을 초과할 수 없다. 모든 국민은 학문과 예술의 자유를 가진다.', 47000, 100, 22, false);
insert into product (project_id, title, description, price, quantity_supplied, quantity_remained, deleted) values (108, '새콤달콤한 벨기에', '모든 국민은 직업선택의 자유를 가진다. 국가는 대외무역을 육성하며, 이를 규제·조정할 수 있다. 국회의 회의는 공개한다. 다만, 출석의원 과반수의 찬성이 있거나 의장이 국가의 안전', 47000, 340, 171, false);
insert into product (project_id, title, description, price, quantity_supplied, quantity_remained, deleted) values (108, '새콤달콤한 불가리아', '선거와 국민투표의 공정한 관리 및 정당에 관한 사무를 처리하기 위하여 선거관리위원회를 둔다. 비상계엄이 선포된 때에는 법률이 정하는 바에 의하여 영장제도, 언론·출판·집회·결사의 ', 5000, 300, 185, false);
insert into product (project_id, title, description, price, quantity_supplied, quantity_remained, deleted) values (109, '달짝지근한 안도라', '국가는 전통문화의 계승·발전과 민족문화의 창달에 노력하여야 한다. 국가는 재해를 예방하고 그 위험으로부터 국민을 보호하기 위하여 노력하여야 한다.', 20000, 420, 171, false);
insert into product (project_id, title, description, price, quantity_supplied, quantity_remained, deleted) values (109, '달짝지근한 알제리', '국회의원이 회기전에 체포 또는 구금된 때에는 현행범인이 아닌 한 국회의 요구가 있으면 회기중 석방된다. 대법원장의 임기는 6년으로 하며, 중임할 수 없다.', 33000, 180, 96, false);
insert into product (project_id, title, description, price, quantity_supplied, quantity_remained, deleted) values (109, '새콤달콤한 모리셔스', '국회는 선전포고, 국군의 외국에의 파견 또는 외국군대의 대한민국 영역안에서의 주류에 대한 동의권을 가진다. 국무회의는 정부의 권한에 속하는 중요한 정책을 심의한다.', 21000, 470, 263, false);
insert into product (project_id, title, description, price, quantity_supplied, quantity_remained, deleted) values (109, '간간한 라트비아', '제3항의 승인을 얻지 못한 때에는 그 처분 또는 명령은 그때부터 효력을 상실한다. 이 경우 그 명령에 의하여 개정 또는 폐지되었던 법률은 그 명령이 승인을 얻지 못한 때부터 당연히', 35000, 490, 209, false);
insert into product (project_id, title, description, price, quantity_supplied, quantity_remained, deleted) values (110, '짭짤한 피지', '국회의원은 현행범인인 경우를 제외하고는 회기중 국회의 동의없이 체포 또는 구금되지 아니한다. 선거에 있어서 최고득표자가 2인 이상인 때에는 국회의 재적의원 과반수가 출석한 공개회의', 26000, 390, 172, false);
insert into product (project_id, title, description, price, quantity_supplied, quantity_remained, deleted) values (110, '되직한 브라질', '국회는 국민의 보통·평등·직접·비밀선거에 의하여 선출된 국회의원으로 구성한다. 교육의 자주성·전문성·정치적 중립성 및 대학의 자율성은 법률이 정하는 바에 의하여 보장된다.', 35000, 370, 206, false);
insert into product (project_id, title, description, price, quantity_supplied, quantity_remained, deleted) values (110, '짭짤한 슬로베니아', '공무원의 신분과 정치적 중립성은 법률이 정하는 바에 의하여 보장된다. 의원을 제명하려면 국회재적의원 3분의 2 이상의 찬성이 있어야 한다. 대한민국의 경제질서는 개인과 기업의 경제', 5000, 210, 119, false);
insert into product (project_id, title, description, price, quantity_supplied, quantity_remained, deleted) values (110, '시큼한 수리남', '헌법개정안이 제2항의 찬성을 얻은 때에는 헌법개정은 확정되며, 대통령은 즉시 이를 공포하여야 한다. 모든 국민은 법률이 정하는 바에 의하여 국방의 의무를 진다.', 33000, 340, 114, false);
insert into product (project_id, title, description, price, quantity_supplied, quantity_remained, deleted) values (111, '매콤한 덴마크', '국가안전보장회의는 대통령이 주재한다. 국무위원은 국정에 관하여 대통령을 보좌하며, 국무회의의 구성원으로서 국정을 심의한다. 모든 국민은 헌법과 법률이 정한 법관에 의하여 법률에 의', 49000, 150, 76, false);
insert into product (project_id, title, description, price, quantity_supplied, quantity_remained, deleted) values (111, '시큼한 수리남', '피고인의 자백이 고문·폭행·협박·구속의 부당한 장기화 또는 기망 기타의 방법에 의하여 자의로 진술된 것이 아니라고 인정될 때 또는 정식재판에 있어서 피고인의 자백이 그에게 불리한 ', 22000, 350, 169, false);
insert into product (project_id, title, description, price, quantity_supplied, quantity_remained, deleted) values (111, '짭짤한 베냉', '대통령으로 선거될 수 있는 자는 국회의원의 피선거권이 있고 선거일 현재 40세에 달하여야 한다. 위원은 탄핵 또는 금고 이상의 형의 선고에 의하지 아니하고는 파면되지 아니한다.', 8000, 120, 56, false);
insert into product (project_id, title, description, price, quantity_supplied, quantity_remained, deleted) values (111, '바삭바삭한 잠비아', '교육의 자주성·전문성·정치적 중립성 및 대학의 자율성은 법률이 정하는 바에 의하여 보장된다. 대법원장의 임기는 6년으로 하며, 중임할 수 없다. 대법원장과 대법관이 아닌 법관의 임', 41000, 250, 126, false);
insert into product (project_id, title, description, price, quantity_supplied, quantity_remained, deleted) values (112, '짭짤한 세인트빈센트 그레나딘', '대통령은 법률에서 구체적으로 범위를 정하여 위임받은 사항과 법률을 집행하기 위하여 필요한 사항에 관하여 대통령령을 발할 수 있다. 대통령은 내란 또는 외환의 죄를 범한 경우를 제외', 5000, 360, 168, false);
insert into product (project_id, title, description, price, quantity_supplied, quantity_remained, deleted) values (112, '짭짤한 아이슬란드', '국회의원은 그 지위를 남용하여 국가·공공단체 또는 기업체와의 계약이나 그 처분에 의하여 재산상의 권리·이익 또는 직위를 취득하거나 타인을 위하여 그 취득을 알선할 수 없다.', 15000, 310, 200, false);
insert into product (project_id, title, description, price, quantity_supplied, quantity_remained, deleted) values (112, '씁쓰름한 엘살바도르', '국가는 여자의 복지와 권익의 향상을 위하여 노력하여야 한다. 제2항의 재판관중 3인은 국회에서 선출하는 자를, 3인은 대법원장이 지명하는 자를 임명한다.', 42000, 290, 103, false);
insert into product (project_id, title, description, price, quantity_supplied, quantity_remained, deleted) values (112, '오동통한 북마리아나 제도', '국교는 인정되지 아니하며, 종교와 정치는 분리된다. 대통령은 법률이 정하는 바에 의하여 훈장 기타의 영전을 수여한다. 모든 국민은 건강하고 쾌적한 환경에서 생활할 권리를 가지며, ', 43000, 170, 82, false);
insert into product (project_id, title, description, price, quantity_supplied, quantity_remained, deleted) values (113, '매콤한 리히텐슈타인', '나는 헌법을 준수하고 국가를 보위하며 조국의 평화적 통일과 국민의 자유와 복리의 증진 및 민족문화의 창달에 노력하여 대통령으로서의 직책을 성실히 수행할 것을 국민 앞에 엄숙히 선서', 20000, 330, 135, false);
insert into product (project_id, title, description, price, quantity_supplied, quantity_remained, deleted) values (113, '새콤달콤한 케냐', '국토와 자원은 국가의 보호를 받으며, 국가는 그 균형있는 개발과 이용을 위하여 필요한 계획을 수립한다. 대한민국은 민주공화국이다. 헌법재판소 재판관은 탄핵 또는 금고 이상의 형의 ', 14000, 180, 91, false);
insert into product (project_id, title, description, price, quantity_supplied, quantity_remained, deleted) values (113, '간간한 라트비아', '국가는 대외무역을 육성하며, 이를 규제·조정할 수 있다. 국무회의는 정부의 권한에 속하는 중요한 정책을 심의한다. 대통령은 법률이 정하는 바에 의하여 훈장 기타의 영전을 수여한다.', 44000, 260, 96, false);
insert into product (project_id, title, description, price, quantity_supplied, quantity_remained, deleted) values (113, '되직한 쿠웨이트', '정당의 목적이나 활동이 민주적 기본질서에 위배될 때에는 정부는 헌법재판소에 그 해산을 제소할 수 있고, 정당은 헌법재판소의 심판에 의하여 해산된다.', 49000, 410, 410, false);
insert into product (project_id, title, description, price, quantity_supplied, quantity_remained, deleted) values (114, '달달한 터키', '이 헌법시행 당시의 대법원장과 대법원판사가 아닌 법관은 제1항 단서의 규정에 불구하고 이 헌법에 의하여 임명된 것으로 본다. 국회의원은 현행범인인 경우를 제외하고는 회기중 국회의 ', 41000, 470, 266, false);
insert into product (project_id, title, description, price, quantity_supplied, quantity_remained, deleted) values (114, '바삭바삭한 에티오피아', '법률이 정하는 주요방위산업체에 종사하는 근로자의 단체행동권은 법률이 정하는 바에 의하여 이를 제한하거나 인정하지 아니할 수 있다. 이 헌법시행 당시의 법령과 조약은 이 헌법에 위배', 20000, 480, 276, false);
insert into product (project_id, title, description, price, quantity_supplied, quantity_remained, deleted) values (114, '짭짤한 이스라엘', '의무교육은 무상으로 한다. 국무총리는 대통령을 보좌하며, 행정에 관하여 대통령의 명을 받아 행정각부를 통할한다. 국무총리 또는 행정각부의 장은 소관사무에 관하여 법률이나 대통령령의', 33000, 430, 246, false);
insert into product (project_id, title, description, price, quantity_supplied, quantity_remained, deleted) values (114, '새콤한 인도', '제안된 헌법개정안은 대통령이 20일 이상의 기간 이를 공고하여야 한다. 사면·감형 및 복권에 관한 사항은 법률로 정한다. 탄핵결정은 공직으로부터 파면함에 그친다. 그러나, 이에 의', 27000, 390, 180, false);
insert into product (project_id, title, description, price, quantity_supplied, quantity_remained, deleted) values (115, '새콤한 코모로', '모든 국민은 법률이 정하는 바에 의하여 선거권을 가진다. 언론·출판에 대한 허가나 검열과 집회·결사에 대한 허가는 인정되지 아니한다. 대통령의 국법상 행위는 문서로써 하며, 이 문', 20000, 420, 140, false);
insert into product (project_id, title, description, price, quantity_supplied, quantity_remained, deleted) values (115, '짭짤한 지부티', '의원을 제명하려면 국회재적의원 3분의 2 이상의 찬성이 있어야 한다. 국교는 인정되지 아니하며, 종교와 정치는 분리된다. 언론·출판은 타인의 명예나 권리 또는 공중도덕이나 사회윤리', 10000, 290, 139, false);
insert into product (project_id, title, description, price, quantity_supplied, quantity_remained, deleted) values (115, '짭짤한 기니', '국가는 과학기술의 혁신과 정보 및 인력의 개발을 통하여 국민경제의 발전에 노력하여야 한다. 모든 국민은 인간으로서의 존엄과 가치를 가지며, 행복을 추구할 권리를 가진다. 국가는 개', 18000, 270, 129, false);
insert into product (project_id, title, description, price, quantity_supplied, quantity_remained, deleted) values (115, '간간한 미크로네시아 연방', '각급 선거관리위원회는 선거인명부의 작성등 선거사무와 국민투표사무에 관하여 관계 행정기관에 필요한 지시를 할 수 있다. 재의의 요구가 있을 때에는 국회는 재의에 붙이고, 재적의원과반', 19000, 170, 72, false);
insert into product (project_id, title, description, price, quantity_supplied, quantity_remained, deleted) values (116, '짭짤한 사하라 아랍 민주 공화국', '법률은 특별한 규정이 없는 한 공포한 날로부터 20일을 경과함으로써 효력을 발생한다. 각급 선거관리위원회의 조직·직무범위 기타 필요한 사항은 법률로 정한다.', 42000, 450, 203, false);
insert into product (project_id, title, description, price, quantity_supplied, quantity_remained, deleted) values (116, '새콤한 인도', '근로조건의 기준은 인간의 존엄성을 보장하도록 법률로 정한다. 대통령의 임기는 5년으로 하며, 중임할 수 없다. 대한민국의 주권은 국민에게 있고, 모든 권력은 국민으로부터 나온다.', 33000, 370, 207, false);
insert into product (project_id, title, description, price, quantity_supplied, quantity_remained, deleted) values (116, '되직한 파푸아뉴기니', '대통령은 취임에 즈음하여 다음의 선서를 한다. 국회는 국무총리 또는 국무위원의 해임을 대통령에게 건의할 수 있다. 근로조건의 기준은 인간의 존엄성을 보장하도록 법률로 정한다.', 32000, 270, 141, false);
insert into product (project_id, title, description, price, quantity_supplied, quantity_remained, deleted) values (116, '시큼한 나이지리아', '대통령으로 선거될 수 있는 자는 국회의원의 피선거권이 있고 선거일 현재 40세에 달하여야 한다. 국정의 중요한 사항에 관한 대통령의 자문에 응하기 위하여 국가원로로 구성되는 국가원', 48000, 500, 500, false);
insert into product (project_id, title, description, price, quantity_supplied, quantity_remained, deleted) values (117, '개운한 예멘', '감사위원은 원장의 제청으로 대통령이 임명하고, 그 임기는 4년으로 하며, 1차에 한하여 중임할 수 있다. 대법원은 법률에 저촉되지 아니하는 범위안에서 소송에 관한 절차, 법원의 내', 7000, 240, 114, false);
insert into product (project_id, title, description, price, quantity_supplied, quantity_remained, deleted) values (117, '새콤한 볼리비아', '대한민국은 통일을 지향하며, 자유민주적 기본질서에 입각한 평화적 통일 정책을 수립하고 이를 추진한다. 모든 국민은 신속한 재판을 받을 권리를 가진다. 형사피고인은 상당한 이유가 없', 10000, 300, 147, false);
insert into product (project_id, title, description, price, quantity_supplied, quantity_remained, deleted) values (117, '담백한 스리랑카', '국무위원은 국무총리의 제청으로 대통령이 임명한다. 대통령은 제4항과 제5항의 규정에 의하여 확정된 법률을 지체없이 공포하여야 한다. 제5항에 의하여 법률이 확정된 후 또는 제4항에', 41000, 320, 183, false);
insert into product (project_id, title, description, price, quantity_supplied, quantity_remained, deleted) values (117, '개운한 탄자니아', '비상계엄이 선포된 때에는 법률이 정하는 바에 의하여 영장제도, 언론·출판·집회·결사의 자유, 정부나 법원의 권한에 관하여 특별한 조치를 할 수 있다.', 40000, 400, 212, false);
insert into product (project_id, title, description, price, quantity_supplied, quantity_remained, deleted) values (118, '짭짤한 이스라엘', '국가는 농수산물의 수급균형과 유통구조의 개선에 노력하여 가격안정을 도모함으로써 농·어민의 이익을 보호한다. 국가는 모성의 보호를 위하여 노력하여야 한다.', 29000, 220, 65, false);
insert into product (project_id, title, description, price, quantity_supplied, quantity_remained, deleted) values (118, '짭짤한 칠레', '대통령의 임기가 만료되는 때에는 임기만료 70일 내지 40일전에 후임자를 선거한다. 여자의 근로는 특별한 보호를 받으며, 고용·임금 및 근로조건에 있어서 부당한 차별을 받지 아니한', 26000, 190, 102, false);
insert into product (project_id, title, description, price, quantity_supplied, quantity_remained, deleted) values (118, '시큼한 이집트', '제2항과 제3항의 처분에 대하여는 법원에 제소할 수 없다. 국가는 법률이 정하는 바에 의하여 재외국민을 보호할 의무를 진다. 대통령은 법률이 정하는 바에 의하여 사면·감형 또는 복', 46000, 130, 59, false);
insert into product (project_id, title, description, price, quantity_supplied, quantity_remained, deleted) values (118, '짭조름한 카타르', '대법원장과 대법관이 아닌 법관의 임기는 10년으로 하며, 법률이 정하는 바에 의하여 연임할 수 있다. 모든 국민은 근로의 권리를 가진다. 국가는 사회적·경제적 방법으로 근로자의 고', 9000, 260, 122, false);
insert into product (project_id, title, description, price, quantity_supplied, quantity_remained, deleted) values (119, '짭짤한 키리바시', '대통령은 조약을 체결·비준하고, 외교사절을 신임·접수 또는 파견하며, 선전포고와 강화를 한다. 대법원장의 임기는 6년으로 하며, 중임할 수 없다. 언론·출판에 대한 허가나 검열과 ', 17000, 340, 144, false);
insert into product (project_id, title, description, price, quantity_supplied, quantity_remained, deleted) values (119, '달콤한 괌', '나랏말싸미 듕귁에 달아 문자와로 서르 사맛띠 아니할쌔 이런 젼차로 어린 백셩이 니르고져 홀빼이셔도 마참내 제 뜨들 시러펴디 못할 노미 하니라.', 30000, 320, 213, false);
insert into product (project_id, title, description, price, quantity_supplied, quantity_remained, deleted) values (119, '되직한 아르헨티나', '국민경제의 발전을 위한 중요정책의 수립에 관하여 대통령의 자문에 응하기 위하여 국민경제자문회의를 둘 수 있다. 정당의 설립은 자유이며, 복수정당제는 보장된다.', 11000, 270, 138, false);
insert into product (project_id, title, description, price, quantity_supplied, quantity_remained, deleted) values (119, '오동통한 르완다', '국회의원의 선거구와 비례대표제 기타 선거에 관한 사항은 법률로 정한다. 대통령의 임기연장 또는 중임변경을 위한 헌법개정은 그 헌법개정 제안 당시의 대통령에 대하여는 효력이 없다.', 13000, 480, 232, false);
insert into product (project_id, title, description, price, quantity_supplied, quantity_remained, deleted) values (120, '짭짤한 사하라 아랍 민주 공화국', '대한민국은 국제평화의 유지에 노력하고 침략적 전쟁을 부인한다. 사면·감형 및 복권에 관한 사항은 법률로 정한다. 환경권의 내용과 행사에 관하여는 법률로 정한다.', 50000, 190, 84, false);
insert into product (project_id, title, description, price, quantity_supplied, quantity_remained, deleted) values (120, '매콤한 통가', '공무원의 신분과 정치적 중립성은 법률이 정하는 바에 의하여 보장된다. 국채를 모집하거나 예산외에 국가의 부담이 될 계약을 체결하려 할 때에는 정부는 미리 국회의 의결을 얻어야 한다', 33000, 490, 247, false);
insert into product (project_id, title, description, price, quantity_supplied, quantity_remained, deleted) values (120, '개운한 멕시코', '국회에 제출된 법률안 기타의 의안은 회기중에 의결되지 못한 이유로 폐기되지 아니한다. 다만, 국회의원의 임기가 만료된 때에는 그러하지 아니하다. 모든 국민은 인간으로서의 존엄과 가', 17000, 190, 73, false);
insert into product (project_id, title, description, price, quantity_supplied, quantity_remained, deleted) values (120, '달달한 알바니아', '대통령은 법률에서 구체적으로 범위를 정하여 위임받은 사항과 법률을 집행하기 위하여 필요한 사항에 관하여 대통령령을 발할 수 있다. 감사원은 세입·세출의 결산을 매년 검사하여 대통령', 33000, 350, 170, false);
insert into product (project_id, title, description, price, quantity_supplied, quantity_remained, deleted) values (121, '담백한 키프로스', '사회적 특수계급의 제도는 인정되지 아니하며, 어떠한 형태로도 이를 창설할 수 없다. 국회의원의 선거구와 비례대표제 기타 선거에 관한 사항은 법률로 정한다.', 24000, 110, 37, false);
insert into product (project_id, title, description, price, quantity_supplied, quantity_remained, deleted) values (121, '짭짤한 팔라우', '모든 국민은 법 앞에 평등하다. 누구든지 성별·종교 또는 사회적 신분에 의하여 정치적·경제적·사회적·문화적 생활의 모든 영역에 있어서 차별을 받지 아니한다.', 49000, 130, 51, false);
