insert into product (project_id, title, description, price, quantity_supplied, quantity_remained, deleted) values (121, '매콤한 바티칸 시국', '국회에 제출된 법률안 기타의 의안은 회기중에 의결되지 못한 이유로 폐기되지 아니한다. 다만, 국회의원의 임기가 만료된 때에는 그러하지 아니하다. 헌법재판소에서 법률의 위헌결정, 탄', 21000, 150, 79, false);
insert into product (project_id, title, description, price, quantity_supplied, quantity_remained, deleted) values (122, '짭조름한 압하스', '국가는 여자의 복지와 권익의 향상을 위하여 노력하여야 한다. 대한민국의 국민이 되는 요건은 법률로 정한다. 모든 국민은 헌법과 법률이 정한 법관에 의하여 법률에 의한 재판을 받을 ', 11000, 320, 78, false);
