insert into product (project_id, title, description, price, quantity_supplied, quantity_remained, deleted) values (122, '매콤한 라오스', '대한민국의 경제질서는 개인과 기업의 경제상의 자유와 창의를 존중함을 기본으로 한다. 법률안에 이의가 있을 때에는 대통령은 제1항의 기간내에 이의서를 붙여 국회로 환부하고, 그 재의', 7000, 280, 116, false);
insert into product (project_id, title, description, price, quantity_supplied, quantity_remained, deleted) values (122, '오동통한 마셜 제도', '국무총리는 대통령을 보좌하며, 행정에 관하여 대통령의 명을 받아 행정각부를 통할한다. 누구든지 병역의무의 이행으로 인하여 불이익한 처우를 받지 아니한다.', 33000, 100, 100, false);
