insert into product (project_id, title, description, price, quantity_supplied, quantity_remained, deleted) values (124, '새콤달콤한 트리니다드 토바고', '국회의원은 그 지위를 남용하여 국가·공공단체 또는 기업체와의 계약이나 그 처분에 의하여 재산상의 권리·이익 또는 직위를 취득하거나 타인을 위하여 그 취득을 알선할 수 없다.', 33000, 220, 93, false);
