insert into product (project_id, title, description, price, quantity_supplied, quantity_remained, deleted) values (128, '시큼한 슬로바키아', '모든 국민은 직업선택의 자유를 가진다. 모든 국민은 법률이 정하는 바에 의하여 납세의 의무를 진다. 누구든지 병역의무의 이행으로 인하여 불이익한 처우를 받지 아니한다.', 50000, 340, 144, false);
