insert into product (project_id, title, description, price, quantity_supplied, quantity_remained, deleted) values (134, '새콤한 코트디부아르', '대통령은 전시·사변 또는 이에 준하는 국가비상사태에 있어서 병력으로써 군사상의 필요에 응하거나 공공의 안녕질서를 유지할 필요가 있을 때에는 법률이 정하는 바에 의하여 계엄을 선포할', 12000, 280, 112, false);
insert into product (project_id, title, description, price, quantity_supplied, quantity_remained, deleted) values (134, '바삭바삭한 잠비아', '중앙선거관리위원회는 대통령이 임명하는 3인, 국회에서 선출하는 3인과 대법원장이 지명하는 3인의 위원으로 구성한다. 위원장은 위원중에서 호선한다.', 17000, 180, 94, false);
insert into product (project_id, title, description, price, quantity_supplied, quantity_remained, deleted) values (135, '짭짤한 라이베리아', '선거에 관한 경비는 법률이 정하는 경우를 제외하고는 정당 또는 후보자에게 부담시킬 수 없다. 의원을 제명하려면 국회재적의원 3분의 2 이상의 찬성이 있어야 한다.', 38000, 110, 49, false);
insert into product (project_id, title, description, price, quantity_supplied, quantity_remained, deleted) values (135, '달짝지근한 보츠와나', '원장은 국회의 동의를 얻어 대통령이 임명하고, 그 임기는 4년으로 하며, 1차에 한하여 중임할 수 있다. 대통령의 임기는 5년으로 하며, 중임할 수 없다. 대한민국은 통일을 지향하', 28000, 200, 90, false);
insert into product (project_id, title, description, price, quantity_supplied, quantity_remained, deleted) values (135, '오동통한 코스타리카', '연소자의 근로는 특별한 보호를 받는다. 국회의원이 회기전에 체포 또는 구금된 때에는 현행범인이 아닌 한 국회의 요구가 있으면 회기중 석방된다. 행정권은 대통령을 수반으로 하는 정부', 10000, 290, 172, false);
insert into product (project_id, title, description, price, quantity_supplied, quantity_remained, deleted) values (135, '씁쓰름한 도미니카', '국가안전보장에 관련되는 대외정책·군사정책과 국내정책의 수립에 관하여 국무회의의 심의에 앞서 대통령의 자문에 응하기 위하여 국가안전보장회의를 둔다.', 24000, 490, 281, false);
insert into product (project_id, title, description, price, quantity_supplied, quantity_remained, deleted) values (136, '담백한 스리랑카', '국가는 주택개발정책등을 통하여 모든 국민이 쾌적한 주거생활을 할 수 있도록 노력하여야 한다. 모든 국민은 법률이 정하는 바에 의하여 공무담임권을 가진다.', 36000, 410, 217, false);
insert into product (project_id, title, description, price, quantity_supplied, quantity_remained, deleted) values (136, '담백한 독일', '국가원로자문회의의 의장은 직전대통령이 된다. 다만, 직전대통령이 없을 때에는 대통령이 지명한다. 모든 국민은 근로의 권리를 가진다. 국가는 사회적·경제적 방법으로 근로자의 고용의 ', 11000, 500, 287, false);
insert into product (project_id, title, description, price, quantity_supplied, quantity_remained, deleted) values (136, '달짝지근한 모리타니', '국회의 회의는 공개한다. 다만, 출석의원 과반수의 찬성이 있거나 의장이 국가의 안전보장을 위하여 필요하다고 인정할 때에는 공개하지 아니할 수 있다.', 50000, 400, 166, false);
insert into product (project_id, title, description, price, quantity_supplied, quantity_remained, deleted) values (136, '담백한 키프로스', '대통령은 국무회의의 의장이 되고, 국무총리는 부의장이 된다. 비상계엄이 선포된 때에는 법률이 정하는 바에 의하여 영장제도, 언론·출판·집회·결사의 자유, 정부나 법원의 권한에 관하', 13000, 120, 52, false);
insert into product (project_id, title, description, price, quantity_supplied, quantity_remained, deleted) values (137, '달달한 중앙아프리카 공화국', '국민경제의 발전을 위한 중요정책의 수립에 관하여 대통령의 자문에 응하기 위하여 국민경제자문회의를 둘 수 있다. 대법원은 법률에 저촉되지 아니하는 범위안에서 소송에 관한 절차, 법원', 39000, 370, 370, false);
insert into product (project_id, title, description, price, quantity_supplied, quantity_remained, deleted) values (137, '달짝지근한 남오세티야', '사법권은 법관으로 구성된 법원에 속한다. 교육의 자주성·전문성·정치적 중립성 및 대학의 자율성은 법률이 정하는 바에 의하여 보장된다. 법원은 최고법원인 대법원과 각급법원으로 조직된', 46000, 190, 99, false);
insert into product (project_id, title, description, price, quantity_supplied, quantity_remained, deleted) values (137, '새콤한 프랑스', '법관이 중대한 심신상의 장해로 직무를 수행할 수 없을 때에는 법률이 정하는 바에 의하여 퇴직하게 할 수 있다. 환경권의 내용과 행사에 관하여는 법률로 정한다.', 34000, 320, 121, false);
insert into product (project_id, title, description, price, quantity_supplied, quantity_remained, deleted) values (137, '바삭바삭한 에콰도르', '탄핵소추의 의결을 받은 자는 탄핵심판이 있을 때까지 그 권한행사가 정지된다. 모든 국민은 직업선택의 자유를 가진다. 국교는 인정되지 아니하며, 종교와 정치는 분리된다.', 22000, 220, 130, false);
insert into product (project_id, title, description, price, quantity_supplied, quantity_remained, deleted) values (138, '달짝지근한 레소토', '지방자치단체는 주민의 복리에 관한 사무를 처리하고 재산을 관리하며, 법령의 범위안에서 자치에 관한 규정을 제정할 수 있다. 국무총리는 대통령을 보좌하며, 행정에 관하여 대통령의 명', 32000, 190, 96, false);
insert into product (project_id, title, description, price, quantity_supplied, quantity_remained, deleted) values (138, '짭짤한 자메이카', '대통령은 헌법과 법률이 정하는 바에 의하여 공무원을 임면한다. 대통령은 제1항과 제2항의 처분 또는 명령을 한 때에는 지체없이 국회에 보고하여 그 승인을 얻어야 한다.', 28000, 120, 43, false);
insert into product (project_id, title, description, price, quantity_supplied, quantity_remained, deleted) values (138, '개운한 나미비아', '국가는 국민 모두의 생산 및 생활의 기반이 되는 국토의 효율적이고 균형있는 이용·개발과 보전을 위하여 법률이 정하는 바에 의하여 그에 관한 필요한 제한과 의무를 과할 수 있다.', 34000, 430, 430, false);
insert into product (project_id, title, description, price, quantity_supplied, quantity_remained, deleted) values (138, '매콤한 중화민국', '모든 국민은 학문과 예술의 자유를 가진다. 위원은 정당에 가입하거나 정치에 관여할 수 없다. 모든 국민은 인간다운 생활을 할 권리를 가진다. 환경권의 내용과 행사에 관하여는 법률로', 7000, 380, 208, false);
insert into product (project_id, title, description, price, quantity_supplied, quantity_remained, deleted) values (139, '짭조름한 네덜란드', '대통령은 국회에 출석하여 발언하거나 서한으로 의견을 표시할 수 있다. 모든 국민은 인간으로서의 존엄과 가치를 가지며, 행복을 추구할 권리를 가진다. 국가는 개인이 가지는 불가침의 ', 14000, 180, 70, false);
insert into product (project_id, title, description, price, quantity_supplied, quantity_remained, deleted) values (139, '매콤한 인도네시아', '법률안에 이의가 있을 때에는 대통령은 제1항의 기간내에 이의서를 붙여 국회로 환부하고, 그 재의를 요구할 수 있다. 국회의 폐회중에도 또한 같다. 대통령은 국가의 원수이며, 외국에', 37000, 420, 211, false);
insert into product (project_id, title, description, price, quantity_supplied, quantity_remained, deleted) values (139, '짭짤한 사하라 아랍 민주 공화국', '선거에 있어서 최고득표자가 2인 이상인 때에는 국회의 재적의원 과반수가 출석한 공개회의에서 다수표를 얻은 자를 당선자로 한다. 근로자는 근로조건의 향상을 위하여 자주적인 단결권·단', 15000, 400, 171, false);
insert into product (project_id, title, description, price, quantity_supplied, quantity_remained, deleted) values (139, '시큼한 슬로바키아', '국회는 상호원조 또는 안전보장에 관한 조약, 중요한 국제조직에 관한 조약, 우호통상항해조약, 주권의 제약에 관한 조약, 강화조약, 국가나 국민에게 중대한 재정적 부담을 지우는 조약', 12000, 160, 52, false);
insert into product (project_id, title, description, price, quantity_supplied, quantity_remained, deleted) values (140, '달짝지근한 폴란드', '국가는 법률이 정하는 바에 의하여 재외국민을 보호할 의무를 진다. 나는 헌법을 준수하고 국가를 보위하며 조국의 평화적 통일과 국민의 자유와 복리의 증진 및 민족문화의 창달에 노력하', 13000, 440, 190, false);
insert into product (project_id, title, description, price, quantity_supplied, quantity_remained, deleted) values (140, '새콤한 카메룬', '대한민국의 국민이 되는 요건은 법률로 정한다. 모든 국민은 그 보호하는 자녀에게 적어도 초등교육과 법률이 정하는 교육을 받게 할 의무를 진다. 국정의 중요한 사항에 관한 대통령의 ', 17000, 400, 184, false);
insert into product (project_id, title, description, price, quantity_supplied, quantity_remained, deleted) values (140, '새콤달콤한 리비아', '국회는 정부의 동의없이 정부가 제출한 지출예산 각항의 금액을 증가하거나 새 비목을 설치할 수 없다. 모든 국민의 재산권은 보장된다. 그 내용과 한계는 법률로 정한다.', 29000, 100, 51, false);
insert into product (project_id, title, description, price, quantity_supplied, quantity_remained, deleted) values (140, '달달한 알바니아', '모든 국민은 종교의 자유를 가진다. 모든 국민은 주거의 자유를 침해받지 아니한다. 주거에 대한 압수나 수색을 할 때에는 검사의 신청에 의하여 법관이 발부한 영장을 제시하여야 한다.', 34000, 370, 161, false);
insert into product (project_id, title, description, price, quantity_supplied, quantity_remained, deleted) values (141, '짭조름한 네덜란드', '국회는 국정을 감사하거나 특정한 국정사안에 대하여 조사할 수 있으며, 이에 필요한 서류의 제출 또는 증인의 출석과 증언이나 의견의 진술을 요구할 수 있다.', 25000, 340, 158, false);
insert into product (project_id, title, description, price, quantity_supplied, quantity_remained, deleted) values (141, '담백한 콩고 공화국', '모든 국민은 종교의 자유를 가진다. 한 회계연도를 넘어 계속하여 지출할 필요가 있을 때에는 정부는 연한을 정하여 계속비로서 국회의 의결을 얻어야 한다.', 46000, 230, 88, false);
insert into product (project_id, title, description, price, quantity_supplied, quantity_remained, deleted) values (141, '간간한 캄보디아', '국가는 균형있는 국민경제의 성장 및 안정과 적정한 소득의 분배를 유지하고, 시장의 지배와 경제력의 남용을 방지하며, 경제주체간의 조화를 통한 경제의 민주화를 위하여 경제에 관한 규', 9000, 270, 123, false);
insert into product (project_id, title, description, price, quantity_supplied, quantity_remained, deleted) values (141, '되직한 쿠웨이트', '국회의원과 정부는 법률안을 제출할 수 있다. 국교는 인정되지 아니하며, 종교와 정치는 분리된다. 대통령은 국회에 출석하여 발언하거나 서한으로 의견을 표시할 수 있다.', 32000, 320, 288, false);
insert into product (project_id, title, description, price, quantity_supplied, quantity_remained, deleted) values (142, '달콤한 짐바브웨', '대통령은 국무총리·국무위원·행정각부의 장 기타 법률이 정하는 공사의 직을 겸할 수 없다. 원장은 국회의 동의를 얻어 대통령이 임명하고, 그 임기는 4년으로 하며, 1차에 한하여 중', 44000, 190, 106, false);
insert into product (project_id, title, description, price, quantity_supplied, quantity_remained, deleted) values (142, '담백한 스웨덴', '국무위원은 국무총리의 제청으로 대통령이 임명한다. 대통령은 국가의 독립·영토의 보전·국가의 계속성과 헌법을 수호할 책무를 진다. 국가는 전통문화의 계승·발전과 민족문화의 창달에 노', 38000, 340, 150, false);
insert into product (project_id, title, description, price, quantity_supplied, quantity_remained, deleted) values (142, '짭짤한 팔라우', '국가는 청원에 대하여 심사할 의무를 진다. 피고인의 자백이 고문·폭행·협박·구속의 부당한 장기화 또는 기망 기타의 방법에 의하여 자의로 진술된 것이 아니라고 인정될 때 또는 정식재', 25000, 300, 171, false);
insert into product (project_id, title, description, price, quantity_supplied, quantity_remained, deleted) values (142, '새콤한 우크라이나', '지방자치단체는 주민의 복리에 관한 사무를 처리하고 재산을 관리하며, 법령의 범위안에서 자치에 관한 규정을 제정할 수 있다. 국정의 중요한 사항에 관한 대통령의 자문에 응하기 위하여', 50000, 300, 143, false);
insert into product (project_id, title, description, price, quantity_supplied, quantity_remained, deleted) values (143, '새콤한 코트디부아르', '선거운동은 각급 선거관리위원회의 관리하에 법률이 정하는 범위안에서 하되, 균등한 기회가 보장되어야 한다. 군인은 현역을 면한 후가 아니면 국무위원으로 임명될 수 없다.', 48000, 130, 58, false);
insert into product (project_id, title, description, price, quantity_supplied, quantity_remained, deleted) values (143, '개운한 탄자니아', '원장은 국회의 동의를 얻어 대통령이 임명하고, 그 임기는 4년으로 하며, 1차에 한하여 중임할 수 있다. 민주평화통일자문회의의 조직·직무범위 기타 필요한 사항은 법률로 정한다.', 9000, 290, 168, false);
insert into product (project_id, title, description, price, quantity_supplied, quantity_remained, deleted) values (143, '씁쓰름한 수단', '대통령은 국무총리·국무위원·행정각부의 장 기타 법률이 정하는 공사의 직을 겸할 수 없다. 헌법개정안은 국회가 의결한 후 30일 이내에 국민투표에 붙여 국회의원선거권자 과반수의 투표', 40000, 130, 30, false);
insert into product (project_id, title, description, price, quantity_supplied, quantity_remained, deleted) values (143, '담백한 브루나이', '제2항과 제3항의 처분에 대하여는 법원에 제소할 수 없다. 체포·구속·압수 또는 수색을 할 때에는 적법한 절차에 따라 검사의 신청에 의하여 법관이 발부한 영장을 제시하여야 한다. ', 26000, 220, 97, false);
insert into product (project_id, title, description, price, quantity_supplied, quantity_remained, deleted) values (144, '매콤한 북키프로스', '국가는 균형있는 국민경제의 성장 및 안정과 적정한 소득의 분배를 유지하고, 시장의 지배와 경제력의 남용을 방지하며, 경제주체간의 조화를 통한 경제의 민주화를 위하여 경제에 관한 규', 6000, 390, 220, false);
insert into product (project_id, title, description, price, quantity_supplied, quantity_remained, deleted) values (144, '되직한 보스니아 헤르체고비나', '대통령이 궐위되거나 사고로 인하여 직무를 수행할 수 없을 때에는 국무총리, 법률이 정한 국무위원의 순서로 그 권한을 대행한다. 위원은 탄핵 또는 금고 이상의 형의 선고에 의하지 아', 34000, 110, 69, false);
insert into product (project_id, title, description, price, quantity_supplied, quantity_remained, deleted) values (144, '시큼한 키르기스스탄', '대통령은 취임에 즈음하여 다음의 선서를 한다. 근로조건의 기준은 인간의 존엄성을 보장하도록 법률로 정한다. 법원은 최고법원인 대법원과 각급법원으로 조직된다.', 30000, 450, 229, false);
insert into product (project_id, title, description, price, quantity_supplied, quantity_remained, deleted) values (144, '새콤달콤한 레바논', '언론·출판은 타인의 명예나 권리 또는 공중도덕이나 사회윤리를 침해하여서는 아니된다. 언론·출판이 타인의 명예나 권리를 침해한 때에는 피해자는 이에 대한 피해의 배상을 청구할 수 있', 37000, 400, 166, false);
insert into product (project_id, title, description, price, quantity_supplied, quantity_remained, deleted) values (145, '짭짤한 베냉', '모든 국민은 법 앞에 평등하다. 누구든지 성별·종교 또는 사회적 신분에 의하여 정치적·경제적·사회적·문화적 생활의 모든 영역에 있어서 차별을 받지 아니한다.', 21000, 460, 191, false);
insert into product (project_id, title, description, price, quantity_supplied, quantity_remained, deleted) values (145, '간간한 웨일즈', '대통령은 국무총리·국무위원·행정각부의 장 기타 법률이 정하는 공사의 직을 겸할 수 없다. 국회는 국무총리 또는 국무위원의 해임을 대통령에게 건의할 수 있다.', 47000, 300, 269, false);
insert into product (project_id, title, description, price, quantity_supplied, quantity_remained, deleted) values (145, '새콤달콤한 말라위', '대한민국은 민주공화국이다. 제2항의 재판관중 3인은 국회에서 선출하는 자를, 3인은 대법원장이 지명하는 자를 임명한다. 국군은 국가의 안전보장과 국토방위의 신성한 의무를 수행함을 ', 15000, 470, 224, false);
insert into product (project_id, title, description, price, quantity_supplied, quantity_remained, deleted) values (145, '달짝지근한 안도라', '대통령이 궐위된 때 또는 대통령 당선자가 사망하거나 판결 기타의 사유로 그 자격을 상실한 때에는 60일 이내에 후임자를 선거한다. 정당의 설립은 자유이며, 복수정당제는 보장된다.', 10000, 270, 102, false);
insert into product (project_id, title, description, price, quantity_supplied, quantity_remained, deleted) values (146, '오동통한 감비아', '헌법재판소의 장은 국회의 동의를 얻어 재판관중에서 대통령이 임명한다. 사면·감형 및 복권에 관한 사항은 법률로 정한다. 법률이 헌법에 위반되는 여부가 재판의 전제가 된 경우에는 법', 44000, 400, 208, false);
insert into product (project_id, title, description, price, quantity_supplied, quantity_remained, deleted) values (146, '되직한 소말리아', '재판의 심리와 판결은 공개한다. 다만, 심리는 국가의 안전보장 또는 안녕질서를 방해하거나 선량한 풍속을 해할 염려가 있을 때에는 법원의 결정으로 공개하지 아니할 수 있다.', 40000, 100, 40, false);
insert into product (project_id, title, description, price, quantity_supplied, quantity_remained, deleted) values (146, '되직한 포르투갈', '비상계엄하의 군사재판은 군인·군무원의 범죄나 군사에 관한 간첩죄의 경우와 초병·초소·유독음식물공급·포로에 관한 죄중 법률이 정한 경우에 한하여 단심으로 할 수 있다. 다만, 사형을', 24000, 200, 103, false);
insert into product (project_id, title, description, price, quantity_supplied, quantity_remained, deleted) values (146, '새콤한 쿠바', '국가원로자문회의의 조직·직무범위 기타 필요한 사항은 법률로 정한다. 모든 국민은 신속한 재판을 받을 권리를 가진다. 형사피고인은 상당한 이유가 없는 한 지체없이 공개재판을 받을 권', 5000, 300, 153, false);
insert into product (project_id, title, description, price, quantity_supplied, quantity_remained, deleted) values (147, '바삭바삭한 미얀마', '헌법재판소의 장은 국회의 동의를 얻어 재판관중에서 대통령이 임명한다. 타인의 범죄행위로 인하여 생명·신체에 대한 피해를 받은 국민은 법률이 정하는 바에 의하여 국가로부터 구조를 받', 10000, 440, 192, false);
insert into product (project_id, title, description, price, quantity_supplied, quantity_remained, deleted) values (147, '새콤달콤한 케냐', '대통령은 국가의 안위에 관계되는 중대한 교전상태에 있어서 국가를 보위하기 위하여 긴급한 조치가 필요하고 국회의 집회가 불가능한 때에 한하여 법률의 효력을 가지는 명령을 발할 수 있', 33000, 260, 176, false);
insert into product (project_id, title, description, price, quantity_supplied, quantity_remained, deleted) values (147, '짭짤한 이스라엘', '국가안전보장회의의 조직·직무범위 기타 필요한 사항은 법률로 정한다. 언론·출판에 대한 허가나 검열과 집회·결사에 대한 허가는 인정되지 아니한다.', 49000, 310, 187, false);
insert into product (project_id, title, description, price, quantity_supplied, quantity_remained, deleted) values (147, '새콤한 인도', '행정각부의 설치·조직과 직무범위는 법률로 정한다. 의원을 제명하려면 국회재적의원 3분의 2 이상의 찬성이 있어야 한다. 비상계엄이 선포된 때에는 법률이 정하는 바에 의하여 영장제도', 47000, 320, 136, false);
insert into product (project_id, title, description, price, quantity_supplied, quantity_remained, deleted) values (148, '새콤한 프랑스', '공무원은 국민전체에 대한 봉사자이며, 국민에 대하여 책임을 진다. 정기회의 회기는 100일을, 임시회의 회기는 30일을 초과할 수 없다. 국군은 국가의 안전보장과 국토방위의 신성한', 24000, 440, 195, false);
insert into product (project_id, title, description, price, quantity_supplied, quantity_remained, deleted) values (148, '달달한 팔레스타인', '국가는 법률이 정하는 바에 의하여 재외국민을 보호할 의무를 진다. 모든 국민은 법률이 정하는 바에 의하여 선거권을 가진다. 국가는 농·어민과 중소기업의 자조조직을 육성하여야 하며,', 25000, 480, 235, false);
insert into product (project_id, title, description, price, quantity_supplied, quantity_remained, deleted) values (148, '새콤달콤한 에스토니아', '모든 국민은 보건에 관하여 국가의 보호를 받는다. 헌법개정안은 국회가 의결한 후 30일 이내에 국민투표에 붙여 국회의원선거권자 과반수의 투표와 투표자 과반수의 찬성을 얻어야 한다.', 5000, 300, 161, false);
insert into product (project_id, title, description, price, quantity_supplied, quantity_remained, deleted) values (148, '새콤달콤한 캐나다', '국무위원은 국정에 관하여 대통령을 보좌하며, 국무회의의 구성원으로서 국정을 심의한다. 언론·출판은 타인의 명예나 권리 또는 공중도덕이나 사회윤리를 침해하여서는 아니된다. 언론·출판', 11000, 180, 103, false);
insert into product (project_id, title, description, price, quantity_supplied, quantity_remained, deleted) values (149, '새콤달콤한 에스토니아', '원장은 국회의 동의를 얻어 대통령이 임명하고, 그 임기는 4년으로 하며, 1차에 한하여 중임할 수 있다. 국가는 농·어민과 중소기업의 자조조직을 육성하여야 하며, 그 자율적 활동과', 42000, 430, 237, false);
insert into product (project_id, title, description, price, quantity_supplied, quantity_remained, deleted) values (149, '달달한 중앙아프리카 공화국', '대통령은 조국의 평화적 통일을 위한 성실한 의무를 진다. 행정각부의 설치·조직과 직무범위는 법률로 정한다. 모든 국민은 건강하고 쾌적한 환경에서 생활할 권리를 가지며, 국가와 국민', 50000, 440, 236, false);
insert into product (project_id, title, description, price, quantity_supplied, quantity_remained, deleted) values (149, '달달한 조지아', '대통령은 국회에 출석하여 발언하거나 서한으로 의견을 표시할 수 있다. 새로운 회계연도가 개시될 때까지 예산안이 의결되지 못한 때에는 정부는 국회에서 예산안이 의결될 때까지 다음의 ', 10000, 250, 103, false);
insert into product (project_id, title, description, price, quantity_supplied, quantity_remained, deleted) values (149, '매콤한 통가', '국가유공자·상이군경 및 전몰군경의 유가족은 법률이 정하는 바에 의하여 우선적으로 근로의 기회를 부여받는다. 감사원의 조직·직무범위·감사위원의 자격·감사대상공무원의 범위 기타 필요한', 40000, 440, 440, false);
insert into product (project_id, title, description, price, quantity_supplied, quantity_remained, deleted) values (150, '담백한 콩고 공화국', '국회가 재적의원 과반수의 찬성으로 계엄의 해제를 요구한 때에는 대통령은 이를 해제하여야 한다. 국회는 국무총리 또는 국무위원의 해임을 대통령에게 건의할 수 있다.', 11000, 260, 158, false);
insert into product (project_id, title, description, price, quantity_supplied, quantity_remained, deleted) values (150, '담백한 브루나이', '모든 국민은 건강하고 쾌적한 환경에서 생활할 권리를 가지며, 국가와 국민은 환경보전을 위하여 노력하여야 한다. 국군의 조직과 편성은 법률로 정한다.', 26000, 180, 90, false);
insert into product (project_id, title, description, price, quantity_supplied, quantity_remained, deleted) values (150, '짭짤한 베냉', '국가는 과학기술의 혁신과 정보 및 인력의 개발을 통하여 국민경제의 발전에 노력하여야 한다. 헌법재판소 재판관의 임기는 6년으로 하며, 법률이 정하는 바에 의하여 연임할 수 있다.', 29000, 300, 139, false);
