insert into product (project_id, title, description, price, quantity_supplied, quantity_remained, deleted) values (151, '매콤한 라오스', '국가는 여자의 복지와 권익의 향상을 위하여 노력하여야 한다. 이 헌법시행 당시의 대법원장과 대법원판사가 아닌 법관은 제1항 단서의 규정에 불구하고 이 헌법에 의하여 임명된 것으로 ', 50000, 350, 188, false);
