insert into product (project_id, title, description, price, quantity_supplied, quantity_remained, deleted) values (152, '시큼한 가봉', '대한민국은 통일을 지향하며, 자유민주적 기본질서에 입각한 평화적 통일 정책을 수립하고 이를 추진한다. 헌법개정안은 국회가 의결한 후 30일 이내에 국민투표에 붙여 국회의원선거권자 ', 45000, 140, 56, false);
insert into product (project_id, title, description, price, quantity_supplied, quantity_remained, deleted) values (152, '달짝지근한 투르크메니스탄', '대통령은 헌법과 법률이 정하는 바에 의하여 국군을 통수한다. 누구든지 체포 또는 구속을 당한 때에는 적부의 심사를 법원에 청구할 권리를 가진다. 국회의원이 회기전에 체포 또는 구금', 5000, 270, 155, false);
insert into product (project_id, title, description, price, quantity_supplied, quantity_remained, deleted) values (152, '되직한 요르단', '대법관은 대법원장의 제청으로 국회의 동의를 얻어 대통령이 임명한다. 광물 기타 중요한 지하자원·수산자원·수력과 경제상 이용할 수 있는 자연력은 법률이 정하는 바에 의하여 일정한 기', 7000, 350, 176, false);
insert into product (project_id, title, description, price, quantity_supplied, quantity_remained, deleted) values (153, '짭조름한 니우에', '국회의원은 국회에서 직무상 행한 발언과 표결에 관하여 국회외에서 책임을 지지 아니한다. 헌법재판소는 법관의 자격을 가진 9인의 재판관으로 구성하며, 재판관은 대통령이 임명한다.', 39000, 340, 264, false);
insert into product (project_id, title, description, price, quantity_supplied, quantity_remained, deleted) values (153, '새콤달콤한 트리니다드 토바고', '대통령은 국민의 보통·평등·직접·비밀선거에 의하여 선출한다. 국회나 그 위원회의 요구가 있을 때에는 국무총리·국무위원 또는 정부위원은 출석·답변하여야 하며, 국무총리 또는 국무위원', 10000, 280, 208, false);
insert into product (project_id, title, description, price, quantity_supplied, quantity_remained, deleted) values (153, '달콤한 사우디아라비아', '대법원에 대법관을 둔다. 다만, 법률이 정하는 바에 의하여 대법관이 아닌 법관을 둘 수 있다. 국가의 세입·세출의 결산, 국가 및 법률이 정한 단체의 회계검사와 행정기관 및 공무원', 33000, 380, 166, false);
insert into product (project_id, title, description, price, quantity_supplied, quantity_remained, deleted) values (153, '되직한 아르헨티나', '모든 국민은 법 앞에 평등하다. 누구든지 성별·종교 또는 사회적 신분에 의하여 정치적·경제적·사회적·문화적 생활의 모든 영역에 있어서 차별을 받지 아니한다.', 43000, 130, 77, false);
insert into product (project_id, title, description, price, quantity_supplied, quantity_remained, deleted) values (154, '되직한 가나', '국가는 농업 및 어업을 보호·육성하기 위하여 농·어촌종합개발과 그 지원등 필요한 계획을 수립·시행하여야 한다. 대통령은 취임에 즈음하여 다음의 선서를 한다.', 16000, 430, 205, false);
insert into product (project_id, title, description, price, quantity_supplied, quantity_remained, deleted) values (154, '바삭바삭한 네팔', '국무위원은 국무총리의 제청으로 대통령이 임명한다. 헌법에 의하여 체결·공포된 조약과 일반적으로 승인된 국제법규는 국내법과 같은 효력을 가진다.', 50000, 460, 204, false);
insert into product (project_id, title, description, price, quantity_supplied, quantity_remained, deleted) values (154, '씁쓰름한 수단', '대통령은 법률에서 구체적으로 범위를 정하여 위임받은 사항과 법률을 집행하기 위하여 필요한 사항에 관하여 대통령령을 발할 수 있다. 훈장등의 영전은 이를 받은 자에게만 효력이 있고,', 32000, 140, 11, false);
insert into product (project_id, title, description, price, quantity_supplied, quantity_remained, deleted) values (154, '달콤한 벨리즈', '국가원로자문회의의 조직·직무범위 기타 필요한 사항은 법률로 정한다. 국민의 모든 자유와 권리는 국가안전보장·질서유지 또는 공공복리를 위하여 필요한 경우에 한하여 법률로써 제한할 수', 27000, 360, 189, false);
insert into product (project_id, title, description, price, quantity_supplied, quantity_remained, deleted) values (155, '새콤한 코모로', '모든 국민은 능력에 따라 균등하게 교육을 받을 권리를 가진다. 국가원로자문회의의 조직·직무범위 기타 필요한 사항은 법률로 정한다. 국민의 모든 자유와 권리는 국가안전보장·질서유지 ', 45000, 190, 97, false);
insert into product (project_id, title, description, price, quantity_supplied, quantity_remained, deleted) values (155, '달달한 헝가리', '정당은 그 목적·조직과 활동이 민주적이어야 하며, 국민의 정치적 의사형성에 참여하는데 필요한 조직을 가져야 한다. 정당의 설립은 자유이며, 복수정당제는 보장된다.', 19000, 480, 234, false);
insert into product (project_id, title, description, price, quantity_supplied, quantity_remained, deleted) values (155, '달짝지근한 모리타니', '대통령은 제3항과 제4항의 사유를 지체없이 공포하여야 한다. 국가는 주택개발정책등을 통하여 모든 국민이 쾌적한 주거생활을 할 수 있도록 노력하여야 한다.', 46000, 470, 245, false);
insert into product (project_id, title, description, price, quantity_supplied, quantity_remained, deleted) values (155, '개운한 탄자니아', '제2항과 제3항의 처분에 대하여는 법원에 제소할 수 없다. 국회는 법률에 저촉되지 아니하는 범위안에서 의사와 내부규율에 관한 규칙을 제정할 수 있다.', 27000, 320, 159, false);
insert into product (project_id, title, description, price, quantity_supplied, quantity_remained, deleted) values (156, '오동통한 트란스니스트리아', '헌법개정은 국회재적의원 과반수 또는 대통령의 발의로 제안된다. 국방상 또는 국민경제상 긴절한 필요로 인하여 법률이 정하는 경우를 제외하고는, 사영기업을 국유 또는 공유로 이전하거나', 24000, 450, 204, false);
insert into product (project_id, title, description, price, quantity_supplied, quantity_remained, deleted) values (156, '달달한 알바니아', '비상계엄하의 군사재판은 군인·군무원의 범죄나 군사에 관한 간첩죄의 경우와 초병·초소·유독음식물공급·포로에 관한 죄중 법률이 정한 경우에 한하여 단심으로 할 수 있다. 다만, 사형을', 38000, 480, 254, false);
insert into product (project_id, title, description, price, quantity_supplied, quantity_remained, deleted) values (156, '달달한 오만', '국회는 국무총리 또는 국무위원의 해임을 대통령에게 건의할 수 있다. 정기회의 회기는 100일을, 임시회의 회기는 30일을 초과할 수 없다. 대통령의 선거에 관한 사항은 법률로 정한', 7000, 340, 162, false);
insert into product (project_id, title, description, price, quantity_supplied, quantity_remained, deleted) values (156, '짭짤한 그레나다', '대법원과 각급법원의 조직은 법률로 정한다. 국가는 평생교육을 진흥하여야 한다. 국회는 헌법 또는 법률에 특별한 규정이 없는 한 재적의원 과반수의 출석과 출석의원 과반수의 찬성으로 ', 9000, 330, 128, false);
insert into product (project_id, title, description, price, quantity_supplied, quantity_remained, deleted) values (157, '간간한 루마니아', '국가는 전통문화의 계승·발전과 민족문화의 창달에 노력하여야 한다. 대통령은 조약을 체결·비준하고, 외교사절을 신임·접수 또는 파견하며, 선전포고와 강화를 한다.', 17000, 310, 112, false);
insert into product (project_id, title, description, price, quantity_supplied, quantity_remained, deleted) values (157, '오동통한 르완다', '국회나 그 위원회의 요구가 있을 때에는 국무총리·국무위원 또는 정부위원은 출석·답변하여야 하며, 국무총리 또는 국무위원이 출석요구를 받은 때에는 국무위원 또는 정부위원으로 하여금 ', 16000, 350, 161, false);
insert into product (project_id, title, description, price, quantity_supplied, quantity_remained, deleted) values (157, '시큼한 키르기스스탄', '국무총리 또는 행정각부의 장은 소관사무에 관하여 법률이나 대통령령의 위임 또는 직권으로 총리령 또는 부령을 발할 수 있다. 각급 선거관리위원회는 선거인명부의 작성등 선거사무와 국민', 44000, 450, 53, false);
insert into product (project_id, title, description, price, quantity_supplied, quantity_remained, deleted) values (157, '새콤달콤한 레바논', '대한민국의 경제질서는 개인과 기업의 경제상의 자유와 창의를 존중함을 기본으로 한다. 대법원장의 임기는 6년으로 하며, 중임할 수 없다. 광물 기타 중요한 지하자원·수산자원·수력과 ', 37000, 350, 173, false);
insert into product (project_id, title, description, price, quantity_supplied, quantity_remained, deleted) values (158, '바삭바삭한 에콰도르', '선거에 있어서 최고득표자가 2인 이상인 때에는 국회의 재적의원 과반수가 출석한 공개회의에서 다수표를 얻은 자를 당선자로 한다. 사법권은 법관으로 구성된 법원에 속한다.', 44000, 120, 61, false);
insert into product (project_id, title, description, price, quantity_supplied, quantity_remained, deleted) values (158, '오동통한 우루과이', '법관이 중대한 심신상의 장해로 직무를 수행할 수 없을 때에는 법률이 정하는 바에 의하여 퇴직하게 할 수 있다. 대통령은 조국의 평화적 통일을 위한 성실한 의무를 진다.', 33000, 390, 217, false);
insert into product (project_id, title, description, price, quantity_supplied, quantity_remained, deleted) values (158, '달콤한 짐바브웨', '국회의원이 회기전에 체포 또는 구금된 때에는 현행범인이 아닌 한 국회의 요구가 있으면 회기중 석방된다. 헌법재판소는 법률에 저촉되지 아니하는 범위안에서 심판에 관한 절차, 내부규율', 10000, 280, 124, false);
insert into product (project_id, title, description, price, quantity_supplied, quantity_remained, deleted) values (158, '새콤한 우크라이나', '헌법재판소는 법관의 자격을 가진 9인의 재판관으로 구성하며, 재판관은 대통령이 임명한다. 대통령은 제4항과 제5항의 규정에 의하여 확정된 법률을 지체없이 공포하여야 한다. 제5항에', 26000, 140, 68, false);
