insert into product (project_id, title, description, price, quantity_supplied, quantity_remained, deleted) values (159, '바삭바삭한 에콰도르', '모든 국민은 신속한 재판을 받을 권리를 가진다. 형사피고인은 상당한 이유가 없는 한 지체없이 공개재판을 받을 권리를 가진다. 헌법재판소는 법관의 자격을 가진 9인의 재판관으로 구성', 32000, 310, 246, false);
insert into product (project_id, title, description, price, quantity_supplied, quantity_remained, deleted) values (159, '짭짤한 자메이카', '국무위원은 국무총리의 제청으로 대통령이 임명한다. 형사피고인은 유죄의 판결이 확정될 때까지는 무죄로 추정된다. 대한민국의 영토는 한반도와 그 부속도서로 한다.', 31000, 230, 230, false);
insert into product (project_id, title, description, price, quantity_supplied, quantity_remained, deleted) values (159, '되직한 시리아', '군인 또는 군무원이 아닌 국민은 대한민국의 영역안에서는 중대한 군사상 기밀·초병·초소·유독음식물공급·포로·군용물에 관한 죄중 법률이 정한 경우와 비상계엄이 선포된 경우를 제외하고는', 29000, 170, 79, false);
insert into product (project_id, title, description, price, quantity_supplied, quantity_remained, deleted) values (160, '짭짤한 칠레', '군사재판을 관할하기 위하여 특별법원으로서 군사법원을 둘 수 있다. 대통령은 법률에서 구체적으로 범위를 정하여 위임받은 사항과 법률을 집행하기 위하여 필요한 사항에 관하여 대통령령을', 11000, 280, 107, false);
