insert into product (project_id, title, description, price, quantity_supplied, quantity_remained, deleted) values (160, '달짝지근한 남오세티야', '연소자의 근로는 특별한 보호를 받는다. 국가는 농업 및 어업을 보호·육성하기 위하여 농·어촌종합개발과 그 지원등 필요한 계획을 수립·시행하여야 한다.', 32000, 430, 201, false);
insert into product (project_id, title, description, price, quantity_supplied, quantity_remained, deleted) values (160, '짭조름한 그리스', '국회의원이 회기전에 체포 또는 구금된 때에는 현행범인이 아닌 한 국회의 요구가 있으면 회기중 석방된다. 국회는 의원의 자격을 심사하며, 의원을 징계할 수 있다.', 42000, 480, 243, false);
