insert into product (project_id, title, description, price, quantity_supplied, quantity_remained, deleted) values (161, '오동통한 코스타리카', '정당은 그 목적·조직과 활동이 민주적이어야 하며, 국민의 정치적 의사형성에 참여하는데 필요한 조직을 가져야 한다. 대통령은 국가의 안위에 관계되는 중대한 교전상태에 있어서 국가를 ', 9000, 390, 207, false);
insert into product (project_id, title, description, price, quantity_supplied, quantity_remained, deleted) values (161, '달짝지근한 상투메 프린시페', '교육의 자주성·전문성·정치적 중립성 및 대학의 자율성은 법률이 정하는 바에 의하여 보장된다. 국회나 그 위원회의 요구가 있을 때에는 국무총리·국무위원 또는 정부위원은 출석·답변하여', 42000, 290, 139, false);
insert into product (project_id, title, description, price, quantity_supplied, quantity_remained, deleted) values (162, '매콤한 라오스', '모든 국민은 신속한 재판을 받을 권리를 가진다. 형사피고인은 상당한 이유가 없는 한 지체없이 공개재판을 받을 권리를 가진다. 국회는 국정을 감사하거나 특정한 국정사안에 대하여 조사', 11000, 120, 62, false);
insert into product (project_id, title, description, price, quantity_supplied, quantity_remained, deleted) values (162, '시큼한 수리남', '광물 기타 중요한 지하자원·수산자원·수력과 경제상 이용할 수 있는 자연력은 법률이 정하는 바에 의하여 일정한 기간 그 채취·개발 또는 이용을 특허할 수 있다.', 25000, 470, 470, false);
insert into product (project_id, title, description, price, quantity_supplied, quantity_remained, deleted) values (162, '새콤달콤한 불가리아', '국회는 헌법개정안이 공고된 날로부터 60일 이내에 의결하여야 하며, 국회의 의결은 재적의원 3분의 2 이상의 찬성을 얻어야 한다. 지방의회의 조직·권한·의원선거와 지방자치단체의 장', 50000, 160, 77, false);
insert into product (project_id, title, description, price, quantity_supplied, quantity_remained, deleted) values (162, '새콤달콤한 리비아', '정당의 목적이나 활동이 민주적 기본질서에 위배될 때에는 정부는 헌법재판소에 그 해산을 제소할 수 있고, 정당은 헌법재판소의 심판에 의하여 해산된다.', 48000, 240, 125, false);
insert into product (project_id, title, description, price, quantity_supplied, quantity_remained, deleted) values (163, '짭조름한 일본', '국민경제의 발전을 위한 중요정책의 수립에 관하여 대통령의 자문에 응하기 위하여 국민경제자문회의를 둘 수 있다. 의무교육은 무상으로 한다. 대통령은 국가의 독립·영토의 보전·국가의 ', 46000, 210, 105, false);
insert into product (project_id, title, description, price, quantity_supplied, quantity_remained, deleted) values (163, '간간한 웨일즈', '국회는 의원의 자격을 심사하며, 의원을 징계할 수 있다. 선거에 관한 경비는 법률이 정하는 경우를 제외하고는 정당 또는 후보자에게 부담시킬 수 없다.', 33000, 290, 110, false);
insert into product (project_id, title, description, price, quantity_supplied, quantity_remained, deleted) values (163, '새콤달콤한 벨기에', '모든 국민은 보건에 관하여 국가의 보호를 받는다. 피고인의 자백이 고문·폭행·협박·구속의 부당한 장기화 또는 기망 기타의 방법에 의하여 자의로 진술된 것이 아니라고 인정될 때 또는', 7000, 320, 176, false);
insert into product (project_id, title, description, price, quantity_supplied, quantity_remained, deleted) values (163, '달콤한 바레인', '국가원로자문회의의 의장은 직전대통령이 된다. 다만, 직전대통령이 없을 때에는 대통령이 지명한다. 대통령은 조약을 체결·비준하고, 외교사절을 신임·접수 또는 파견하며, 선전포고와 강', 41000, 380, 162, false);
insert into product (project_id, title, description, price, quantity_supplied, quantity_remained, deleted) values (164, '달콤한 아르차흐 공화국', '국가는 농지에 관하여 경자유전의 원칙이 달성될 수 있도록 노력하여야 하며, 농지의 소작제도는 금지된다. 언론·출판에 대한 허가나 검열과 집회·결사에 대한 허가는 인정되지 아니한다.', 16000, 380, 179, false);
insert into product (project_id, title, description, price, quantity_supplied, quantity_remained, deleted) values (164, '새콤달콤한 우간다', '대통령은 내란 또는 외환의 죄를 범한 경우를 제외하고는 재직중 형사상의 소추를 받지 아니한다. 대통령은 국민의 보통·평등·직접·비밀선거에 의하여 선출한다.', 24000, 180, 82, false);
insert into product (project_id, title, description, price, quantity_supplied, quantity_remained, deleted) values (164, '되직한 브라질', '의무교육은 무상으로 한다. 공공필요에 의한 재산권의 수용·사용 또는 제한 및 그에 대한 보상은 법률로써 하되, 정당한 보상을 지급하여야 한다. 행정권은 대통령을 수반으로 하는 정부', 10000, 280, 92, false);
insert into product (project_id, title, description, price, quantity_supplied, quantity_remained, deleted) values (164, '새콤달콤한 니제르', '대통령은 법률안의 일부에 대하여 또는 법률안을 수정하여 재의를 요구할 수 없다. 이 헌법시행 당시의 법령과 조약은 이 헌법에 위배되지 아니하는 한 그 효력을 지속한다.', 11000, 420, 189, false);
